  '{"id":138,"name":"Bloody Nora","brewery":"Hop Union","barCode":"B14","barName":"Goat and Tricycle","barLocation":"National Hall","abv":"4.7","colour":"#dca001","style":"Speciality - Flavoured Light","styleImage":"Session Pale","dispenseMethod":"Cask","tags":["Hoppy","Orange","Marmalade","Chocolate","Idaho 7","Simcoe","Citra"],"notes":"Orange is evident in the hoppy aroma and has the flavour of a slightly bitter marmalade and continues into the bittersweet aftertaste. Light Marris Otter and pale chocolate in the mash give the golden-orange colour. Orange peel in the whirlpool creates a subtle pithy bitterness. Idaho 7, Citra and Simcoe added at various stages during fermentation layer in tropical orange-citrus flavours.","vegan":true,"glutenFree":false}',
  '{"id":139,"name":"Nelson Sauvin Pale","brewery":"Incredible","barCode":"B14","barName":"Goat and Tricycle","barLocation":"National Hall","abv":"4.2","colour":"#be7001","style":"Premium Pale Ale","styleImage":"Strong Blonde","dispenseMethod":"Cask","tags":["Tropical","Lychee","Mango","Gooseberries","Pepper"],"notes":"As powerful as it is versatile, the low cohumulone content of Nelson Sauvin lends a super smooth bitterness when used on the hot side, but it’s the cold side where this NZ slammer comes to life; imparting an incredible bouquet of intense tropical notes; think lychee, mango, freshly crushed gooseberries and spicy black pepper.","vegan":true,"glutenFree":false}',
  '{"id":140,"name":"Prometheus","brewery":"Inferno","barCode":"B14","barName":"Goat and Tricycle","barLocation":"National Hall","abv":"5.8","colour":"#b04500","style":"Premium Pale Ale","styleImage":"British Ipa","dispenseMethod":"Cask","tags":["Hoppy","Smooth","Pale","Earthy","Astringency","Fruits","Honey"],"notes":"A triple-hopped pale and hoppy ale with a bright, spicy, earthy aroma with oyster mushroom notes. Smooth on the palate with a touch of honey sweetness. Earthy and spicy hops dominate the flavour with a good malt backbone. Long bitter, medium astringency finish with some hedgerow fruits evident.","vegan":false,"glutenFree":false}',
