  '{"id":142,"name":"Renown","brewery":"Leigh on Sea","barCode":"B14","barName":"Goat and Tricycle","barLocation":"National Hall","abv":"4","colour":"#070b0c","style":"Session Stout","styleImage":"Porter","dispenseMethod":"Cask","tags":["Stout","Chocolate","Caramel","Coffee","Cockles"],"notes":"A cockle stout brewed with Leigh-on-Sea cockles in the boil (obviously a departure from the usual vegan policy!) and is a take on an Oyster Stout. It is jet black in appearance with a bright white fluffy head, and aromas of chocolate and roasted malt. The flavours are of chocolate, coffee, caramel, with a lightly roasted finish. The cockles are added towards the end of the boil, joining Magnum and Golding hops. Renown was one of the six cockle boats from Leigh-on-Sea involved in the Dunkirk troop rescue. Renown was an Osborne Bros boat and was tragically lost on the return journey, being struck by a mine with the loss of four lives. The story is kept alive with this distinctive beer and it is considered highly appropriate that the cockles used come from the current day Osborne Bros business.","vegan":false,"glutenFree":false}',
