  '{"id":206,"name":"Iceberg","brewery":"Titanic","barCode":"B16","barName":"Shared Brewery Bar","barLocation":"National Hall","abv":"4.1","colour":"#ebc325","style":"Speciality - Differently Produced Light","styleImage":"American Ipa","dispenseMethod":"Cask","tags":["Pale Ale","Hoppy"],"notes":"Yellow gold sparkling wheat beer with a flowery start leading to a great hop crescendo.","vegan":false,"glutenFree":false}',
