  '{"id":208,"name":"Chocolate and Vanilla Stout","brewery":"Titanic","barCode":"B16","barName":"Shared Brewery Bar","barLocation":"National Hall","abv":"4.5","colour":"#070b0c","style":"Speciality - Flavoured Dark","styleImage":"Porter","dispenseMethod":"Cask","tags":["Coffee","Creamy","Chocolate"],"notes":"Chocoholic paradise with real coffee and vanilla support. Cocoa, sherry and almonds lend depth to this creamy, drinkable \\\"Heaven in a glass\\\" stout.","vegan":false,"glutenFree":false}',
  '{"id":209,"name":"Raspberry Pale","brewery":"Titanic","barCode":"B16","barName":"Shared Brewery Bar","barLocation":"National Hall","abv":"4.7","colour":"#dca001","style":"Speciality - Flavoured Light","styleImage":"Session Pale","dispenseMethod":"Cask","tags":["Wheat beer","Fruits","raspberry"],"notes":"This wonderfully fruity wheat beer is refreshingly and light. Raspberry flavours bounce off the hops perfectly to result in a unique, balanced beer.","vegan":false,"glutenFree":false}',
  '{"id":210,"name":"Cherry Porter","brewery":"Titanic","barCode":"B16","barName":"Shared Brewery Bar","barLocation":"National Hall","abv":"4.9","colour":"#070b0c","style":"Speciality - Flavoured Dark","styleImage":"Porter","dispenseMethod":"Cask","tags":["Porter","Fruity","Dark"],"notes":"A well rounded fruity porter, hoppy with notes of sweet cherry.","vegan":false,"glutenFree":false}',
  '{"id":211,"name":"Plum Porter","brewery":"Titanic","barCode":"B16","barName":"Shared Brewery Bar","barLocation":"National Hall","abv":"4.9","colour":"#070b0c","style":"Speciality - Flavoured Dark","styleImage":"Porter","dispenseMethod":"Cask","tags":["Malty","Bitter","Dark","Brown","Fruity","Plum","Bitter finish","Sweet"],"notes":"Dark brown with fruity spangles on the nose. Sweet plum fruitiness gives way to a gentle malty bitter finish with some cherry sides.","vegan":false,"glutenFree":false}',
  '{"id":212,"name":"Red Kite","brewery":"Vale","barCode":"B16","barName":"Shared Brewery Bar","barLocation":"National Hall","abv":"4.3","colour":"#4b100c","style":"Session Golden Ale","styleImage":"Red Ale","dispenseMethod":"Cask","tags":["Bitter","Refreshing","Bitter finish"],"notes":"Golden ale, with rich malt flavours and a smooth hop finish","vegan":false,"glutenFree":false}',
  '{"id":213,"name":"Black Beauty Porter","brewery":"Vale","barCode":"B16","barName":"Shared Brewery Bar","barLocation":"National Hall","abv":"4.4","colour":"#070b0c","style":"Session Porter","styleImage":"Porter","dispenseMethod":"Cask","tags":["Malty","Hoppy","Dark","Dry","Rich","Intense"],"notes":"A very dark ale, the initial aroma is malty. Roast malt dominates initially and is followed by a rich fruitiness, with some sweetness. The finish is increasingly hoppy and dry.","vegan":false,"glutenFree":false}',
  '{"id":214,"name":"Gravitas","brewery":"Vale","barCode":"B16","barName":"Shared Brewery Bar","barLocation":"National Hall","abv":"4.8","colour":"#dca001","style":"Premium Pale Ale","styleImage":"Session Pale","dispenseMethod":"Cask","tags":["Malty","Strong","Citrus","Pale","Dry","Biscuit"],"notes":"A Pale Ale packed with citrus notes, rounded off by a dry, biscuit finish.","vegan":false,"glutenFree":false}',
  '{"id":215,"name":"Bure Gold","brewery":"Woodforde\'s","barCode":"B16","barName":"Shared Brewery Bar","barLocation":"National Hall","abv":"4.3","colour":"#be7001","style":"Session Golden Ale","styleImage":"Strong Blonde","dispenseMethod":"Cask","tags":["Bitter","Citrus","Biscuit","Sweet"],"notes":"Singularly citrus throughout with a succinct hop garland. Sweet biscuit floats in the background over a bitter footing.","vegan":false,"glutenFree":false}',
  '{"id":216,"name":"Nelson\'s","brewery":"Woodforde\'s","barCode":"B16","barName":"Shared Brewery Bar","barLocation":"National Hall","abv":"4.5","colour":"#4b100c","style":"Premium Golden Ale","styleImage":"Red Ale","dispenseMethod":"Cask","tags":["Caramel","Fruits","Rich","Sweet"],"notes":"A holy trinity of malt, hop and vine fruits dominate this full-bodied, well balanced brew. Caramel and bitterness add depth and contrast as the flavours roll on.","vegan":false,"glutenFree":false}',
  '{"id":217,"name":"Volt","brewery":"Woodforde\'s","barCode":"B16","barName":"Shared Brewery Bar","barLocation":"National Hall","abv":"4.5","colour":"#ebc325","style":"Premium Pale Ale","styleImage":"American Ipa","dispenseMethod":"Cask","tags":["Biscuit","Floral","Citrus","Tropical"],"notes":"Rollicking mix of lemon, lime, hop and biscuit. Slightly astringent resinous notes make a late appearance to add crispness and character.","vegan":false,"glutenFree":false}',
  '{"id":218,"name":"Wherry","brewery":"Woodforde\'s","barCode":"B16","barName":"Shared Brewery Bar","barLocation":"National Hall","abv":"3.8","colour":"#dca001","style":"Session Golden Ale","styleImage":"Session Pale","dispenseMethod":"Cask","tags":["Hoppy","Citrus","Biscuit","Sweet","Amber","Orange"],"notes":"A sweet biscuit base is underpinned by strawberries and a contrasting hoppy bitterness. Long and well balanced with a noticeably citrus enhanced encore.","vegan":false,"glutenFree":false}',
  '{"id":219,"name":"Hoperation","brewery":"Arkell\'s","barCode":"B17","barName":"Shared Brewery Bar","barLocation":"National Hall","abv":"4.2","colour":"#dca001","style":"Premium Pale Ale","styleImage":"Session Pale","dispenseMethod":"Cask","tags":["Oats","American Hobs","Wheat"],"notes":"A blend of English and American hops brought together to create a powerful hop flavour in this Pale Ale with oats and wheat in the grist to provide a smooth rounded finish.","vegan":false,"glutenFree":false}',
  '{"id":220,"name":"Tradition","brewery":"Arkell\'s","barCode":"B17","barName":"Shared Brewery Bar","barLocation":"National Hall","abv":"3.4","colour":"#dca001","style":"Speciality - Flavoured Light","styleImage":"Session Pale","dispenseMethod":"Cask","tags":["pale","quaffable"],"notes":"Light hoppy quaffable pale beer brewed to mark Arkell\'s 180th anniversary.","vegan":false,"glutenFree":false}',
  '{"id":221,"name":"3B","brewery":"Arkell\'s","barCode":"B17","barName":"Shared Brewery Bar","barLocation":"National Hall","abv":"4","colour":"#4b100c","style":"Premium Bitter","styleImage":"Red Ale","dispenseMethod":"Cask","tags":["Strong","Brown","Dry","Caramel"],"notes":"Originally known as Arkell’s Best Bitter Beer. First brewed in 1910 and affectionately known as BBB or 3B by customers ever since. A copper coloured Ale with a pleasant fruity and malty nose. It has a lingering bittersweet flavour of balanced Maris Otter malt and traditional Fuggles and Golding hops.","vegan":false,"glutenFree":false}',
  '{"id":222,"name":"Ridley\'s Rite","brewery":"Bishop Nick","barCode":"B17","barName":"Shared Brewery Bar","barLocation":"National Hall","abv":"3.6","colour":"#dca001","style":"Session Pale Ale","styleImage":"Session Pale","dispenseMethod":"Cask","tags":["Bitter","Classic","Floral","Pale","Fuggles","Goldings","Crystal"],"notes":"The Ridley family knows what Essex wants when it comes to good, honest session beer, so get your taste buds around this classic beauty. English Fuggles and Goldings do a sterling job of balancing crystal and pale ale malts, working their hops off for a floral aroma and a satisfying bitterness that is subtle but, like us, in it for the long haul.","vegan":false,"glutenFree":false}',
  '{"id":223,"name":"Heresy","brewery":"Bishop Nick","barCode":"B17","barName":"Shared Brewery Bar","barLocation":"National Hall","abv":"4","colour":"#dca001","style":"Session Pale Ale","styleImage":"Session Pale","dispenseMethod":"Cask","tags":["Citrus","Pale","Refreshing","Golden","Goldings"],"notes":"We are talking about uncompromising refreshment here. Bishop Nick was executed a heretic because he wouldn’t renounce his faith, so we’re not compromising either. Heresy is the holy grail of golden ale. Top-notch pale ale malt and Challenger hops commit the brew to spicy bitterness before Goldings set about delivering citrus and florals. This is resolute refreshment.","vegan":false,"glutenFree":false}',
  '{"id":224,"name":"1555","brewery":"Bishop Nick","barCode":"B17","barName":"Shared Brewery Bar","barLocation":"National Hall","abv":"5.1","colour":"#b04500","style":"Session Golden Ale","styleImage":"British Ipa","dispenseMethod":"Cask","tags":["Goldings","Tawny","Ginger"],"notes":"Now this is a seriously full-bodied ale. No messing. Bishop Nick wasn’t burnt at the stake in 1555 so we could sit quietly and sip weak ale. Not a chance. This rich tawny beer is a tribute to defiance. With an unmistakably sweet nutty taste underlined by the ginger and fruit of Styrian goldings, 1555 shall not be moved.","vegan":false,"glutenFree":false}',
  '{"id":225,"name":"Pilcrow Pale","brewery":"Dorking","barCode":"B17","barName":"Shared Brewery Bar","barLocation":"National Hall","abv":"4","colour":"#dca001","style":"Session Pale Ale","styleImage":"Session Pale","dispenseMethod":"Cask","tags":["Citra","Chinook","Citrus","Tropical"],"notes":"Flagship pale ale harnesses the incredible Citra and Chinook hops from Yakima valley on the west coast of America, creating a juicy combination of citrus and tropical flavours. Five different malts marry to balance a well-rounded pale ale that packs a punch.","vegan":true,"glutenFree":false}',
  '{"id":226,"name":"Black Noise","brewery":"Dorking","barCode":"B17","barName":"Shared Brewery Bar","barLocation":"National Hall","abv":"4.5","colour":"#070b0c","style":"Session Porter","styleImage":"Porter","dispenseMethod":"Cask","tags":["Rich","Biscuit","Unfined","Chocolate"],"notes":"A combination of roasted malts and oats create a smooth, toasty beer with chocolate notes. British hops and yeast are added to finish off this moreish mouthful. Unfined and vegan friendly","vegan":true,"glutenFree":false}',
  '{"id":227,"name":"Five Claw","brewery":"Dorking","barCode":"B17","barName":"Shared Brewery Bar","barLocation":"National Hall","abv":"5.1","colour":"#be7001","style":"New World IPA","styleImage":"Strong Blonde","dispenseMethod":"Cask","tags":["Tropical","Hazy"],"notes":"Six different hops from around the world collide to make our powerful west coast style IPA. Strong tropical fruit aromas and higher bitterness make Five Claw hard to put down. Left naturally hazy to give an authentic colour, appearance and mouthfeel of a full on west coast IPA.","vegan":true,"glutenFree":false}',
  '{"id":228,"name":"Joined at the Hop","brewery":"Iron Pier","barCode":"B17","barName":"Shared Brewery Bar","barLocation":"National Hall","abv":"3.8","colour":"#dca001","style":"Session Golden Ale","styleImage":"Session Pale","dispenseMethod":"Cask","tags":["Light","Golden"],"notes":"A light golden ale, with a hint of grainy malts as a backdrop to a varying pairing of hops.","vegan":true,"glutenFree":false}',
  '{"id":229,"name":"Wealdway","brewery":"Iron Pier","barCode":"B17","barName":"Shared Brewery Bar","barLocation":"National Hall","abv":"4.5","colour":"#dca001","style":"Session Pale Ale","styleImage":"Session Pale","dispenseMethod":"Cask","tags":["Colunbus","Chinook","Resinous","Pine","Citrus"],"notes":"A session strength IPA packed full of Columbus and Chinook for a piney, resinous aroma and balanced bitterness.","vegan":true,"glutenFree":false}',
  '{"id":230,"name":"Cast Iron Stout","brewery":"Iron Pier","barCode":"B17","barName":"Shared Brewery Bar","barLocation":"National Hall","abv":"4.8","colour":"#070b0c","style":"Strong Stout","styleImage":"Porter","dispenseMethod":"Cask","tags":["Toffee","Chocolate","Coffee"],"notes":"Rich chocolate and coffee with a hint of toffee popcorn, leading into a slightly bitter smooth finish.","vegan":true,"glutenFree":false}',
  '{"id":231,"name":"The Bandon Car Irish Porter","brewery":"Lord\'s","barCode":"B17","barName":"Shared Brewery Bar","barLocation":"National Hall","abv":"4.8","colour":"#070b0c","style":"Strong Porter","styleImage":"Porter","dispenseMethod":"Cask","tags":["Rich","Roasted"],"notes":"This well-balanced porter is rich and satisfying, with a roasted edge and a sweet lingering aftertaste. Our tribute to County Cork","vegan":true,"glutenFree":false}',
  '{"id":232,"name":"Sunshine State West Coast Pale","brewery":"Lord\'s","barCode":"B17","barName":"Shared Brewery Bar","barLocation":"National Hall","abv":"5.2","colour":"#dca001","style":"New World IPA","styleImage":"Session Pale","dispenseMethod":"Cask","tags":["Citrus","Pine","Floral","Unfined"],"notes":"This beer is robustly hopped giving it an intense flavour that is undeniably more-ish. Bursting with citrus, pine and floral overtones, which give way to a lightly toasted crisp malt base. England to San Diego in sip.","vegan":true,"glutenFree":false}',
  '{"id":233,"name":"New Wave IPA","brewery":"Lord\'s","barCode":"B17","barName":"Shared Brewery Bar","barLocation":"National Hall","abv":"5.6","colour":"#dca001","style":"New World IPA","styleImage":"Session Pale","dispenseMethod":"Cask","tags":["Citrus","Pine","Floral"],"notes":"A robustly hopped beer giving it an intense flavour that is undeniably more-ish. Bursting with citrus, pine and floral overtones, which give way to a lightly toasted crisp malt base. England to San Diego in sip.","vegan":true,"glutenFree":false}',
  '{"id":234,"name":"Butterley","brewery":"Ossett","barCode":"B17","barName":"Shared Brewery Bar","barLocation":"National Hall","abv":"3.8","colour":"#dca001","style":"Session Pale Ale","styleImage":"Session Pale","dispenseMethod":"Cask","tags":["Bitter","Light","Pale","Refreshing","Challenger","Goldings","Honey"],"notes":"A traditional, easy drinking Yorkshire Bitter, made from all British ingredients. Pale copper in colour, this beer initially has sweet malt and honey on the palate, followed by a moderately bitter finish. The delicate hop aromas can be described as floral and spicy.","vegan":false,"glutenFree":false}',
  '{"id":235,"name":"Yorkshire Blonde","brewery":"Ossett","barCode":"B17","barName":"Shared Brewery Bar","barLocation":"National Hall","abv":"3.9","colour":"#dca001","style":"Session Pale Ale","styleImage":"Session Pale","dispenseMethod":"Cask","tags":["Bitter","Fruity","Bitter finish","Sweet","Pale","Peachy"],"notes":"This pale ale is full-bodied, well-rounded and slightly sweet on the palate. A generous addition of Mount Hood hops late in the boil result in a delicate fruity aroma.","vegan":false,"glutenFree":false}',
  '{"id":236,"name":"White Rat","brewery":"Ossett","barCode":"B17","barName":"Shared Brewery Bar","barLocation":"National Hall","abv":"4","colour":"#ebc325","style":"Session Pale Ale","styleImage":"American Ipa","dispenseMethod":"Cask","tags":["Citrus","Sweet","Hoppy","Pale","Cascade","Columbus","Amarillo"],"notes":"This very pale, hoppy ale is made from low colour malt. A combination of Cascade, Columbus and Amarillo hops produce an intensely aromatic and resinous finish.","vegan":false,"glutenFree":false}',
  '{"id":237,"name":"Silver King","brewery":"Ossett","barCode":"B17","barName":"Shared Brewery Bar","barLocation":"National Hall","abv":"4.3","colour":"#dca001","style":"Session Pale Ale","styleImage":"Session Pale","dispenseMethod":"Cask","tags":["Fruity","Citrus","Dry","Lager","Cascade"],"notes":"This regal beer continues to be a timeless classic. A simple combination of UK grown pale malt and American Cascade hops result in a crisp, dry and refreshing pale ale with aromas of citrus fruit and balanced bitterness.","vegan":false,"glutenFree":true}',
  '{"id":238,"name":"Voodoo","brewery":"Ossett","barCode":"B17","barName":"Shared Brewery Bar","barLocation":"National Hall","abv":"5","colour":"#070b0c","style":"Speciality - Flavoured Dark","styleImage":"Porter","dispenseMethod":"Cask","tags":["Chocolate","Smooth","Orange","Vanilla"],"notes":"A deliciously rich and full-bodied stout, brewed from pale, roasted and chocolate malts. Smooth and with moderate bitterness, chocolate flavours dominate the palate paired with aromas of orange and vanilla.","vegan":false,"glutenFree":false}',
  '{"id":239,"name":"Excelsius","brewery":"Ossett","barCode":"B17","barName":"Shared Brewery Bar","barLocation":"National Hall","abv":"5.2","colour":"#dca001","style":"Premium Pale Ale","styleImage":"Session Pale","dispenseMethod":"Cask","tags":["Hoppy","Strong","Floral","Citrus","Pale"],"notes":"A classic pale ale, brewed from British pale malt and US Cascade hops. Smooth, fruity and full-bodied, with a deceptive bitterness to complement its alcohol strength. Refreshing citrus hop aromas complete the sensory pleasure.","vegan":false,"glutenFree":false}',
  '{"id":240,"name":"Ghost Ship","brewery":"Adnams","barCode":"B18c","barName":"Adnams","barLocation":"National Hall","abv":"4.5","colour":"#b04500","style":"Session Golden Ale","styleImage":"British Ipa","dispenseMethod":"Cask","tags":["Pale","Orange","Hoppy","Citrus","Citra","Cara"],"notes":"Ghost Ship is brewed with Pale Ale, Rye Crystal and Cara Malts which add depth and those moreish, biscuity hints we all know and love. A blend of Citra and other American hop varieties provide Ghost Ship\'s bold citrus flavours of lemon and lime, aromatic elderflower notes, and that famous hoppy finish.","vegan":false,"glutenFree":false}',
  '{"id":241,"name":"Southwold Bitter","brewery":"Adnams","barCode":"B18c","barName":"Adnams","barLocation":"National Hall","abv":"3.7","colour":"#b04500","style":"Session Bitter","styleImage":"British Ipa","dispenseMethod":"Cask","tags":["Bitter","Session","Creamy","Caramel","Sweet","Herbal"],"notes":"Impressive creamy copper-coloured session bitter. Aromas of herbal hop, sweet malt and hints of caramel. Taste is a balanced bitter-sweet mix of hops and underlying nutty malt with touches of fruit, all lingering into the satisfying aftertaste.","vegan":false,"glutenFree":false}',
  '{"id":242,"name":"Mosaic Pale Ale","brewery":"Adnams","barCode":"B18c","barName":"Adnams","barLocation":"National Hall","abv":"4.1","colour":"#dca001","style":"Session Blond Ale","styleImage":"Session Pale","dispenseMethod":"Cask","tags":["Mosaic","Fruity"],"notes":"Mosaic Pale Ale is a showcase for an exciting American hop by the same name; and just like its name suggests, there is a complexity and a vibrancy to its profile. It provides a real mosaic of fruity and floral characteristics, that quickly made it a favourite in the brewing world. We’ve used a base of light malts to really lets those bold hop flavours and aromas shine, enabling you to discover something different with every sip. This fresh, hop-forward favourite provides a mosaic of aromatic fruit and floral flavours. You’ll find notes of mango, peach, lemon, gooseberry, and pine - all from the use of marvellous Mosaic hops.","vegan":false,"glutenFree":false}',
  '{"id":243,"name":"Broadside","brewery":"Adnams","barCode":"B18c","barName":"Adnams","barLocation":"National Hall","abv":"4.7","colour":"#4b100c","style":"Red Ale","styleImage":"Red Ale","dispenseMethod":"Cask","tags":["Malty","Brown","Fruity","Rich","Creamy","Caramel","Sweet","Strong","Dark","Chocolate","Red","Warming"],"notes":"Rich, creamy ruby brown beer. A malty aroma with berry and dried fruit and caramel develops into a balanced palate of malt, hops and fruit with underlying bitterness and caramel, ending fruity with sweet malt.","vegan":false,"glutenFree":false}',
  '{"id":244,"name":"Dry Hopped Lager","brewery":"Adnams","barCode":"B18c","barName":"Adnams","barLocation":"National Hall","abv":"4.2","colour":"#dca001","style":"Speciality - Differently Produced Light","styleImage":"Session Pale","dispenseMethod":"KeyKeg","tags":["Galaxy","Peach","Passionfruit"],"notes":"Brewed with pale malts and used peachy Australian Galaxy hops to add a fruity twist to our delicious lager. It is then lagered, or cold conditioned, to give a full, well-rounded flavour and that dry, refreshing bite. Galaxy hops are descended from the excellent German allrounder, Perle, and are known for their amazing peach, and passionfruit aromas, especially when used as a late addition.","vegan":false,"glutenFree":false}',
  '{"id":245,"name":"Ease Up IPA","brewery":"Adnams","barCode":"B18c","barName":"Adnams","barLocation":"National Hall","abv":"4.6","colour":"#dca001","style":"British IPA","styleImage":"Session Pale","dispenseMethod":"KeyKeg","tags":["Grapefruit","Centennial","Pilgrim"],"notes":"Ease Up is a golden session IPA with wonderful citrus flavours thanks to a stellar cast of bright, aromatic hops. Following calls to add a gluten free beer to the Adnams range, they tweaked the process when brewing it, making its big-hitting more accessible. It still has that same great grapefruit flavour, but it’s now also gluten free.","vegan":false,"glutenFree":true}',
  '{"id":246,"name":"Innovation IPA","brewery":"Adnams","barCode":"B18c","barName":"Adnams","barLocation":"National Hall","abv":"6.7","colour":"#dca001","style":"British IPA","styleImage":"Session Pale","dispenseMethod":"KeyKeg","tags":["Strong","Light","Fruity","Grapefruit"],"notes":"The initial assertive hoppiness delivers big flavours of grapefruit and mango, which are quickly balanced by a subtle, honeyed sweetness, and a caramelised, almost chewy finish. Delicious and fruity, you’ll find underlying hints of spice as its light base allows Adnams’ house yeast characteristics to shine through. Innovation IPA is light, deceptively strong, and perfectly balanced, thanks to the use of wheat in its recipe. It was originally brewed as a celebration beer and was launched in 2010 on completion of the installation of Adnams new brewery, after a period of considerable investment in sustainable technology across the company.","vegan":false,"glutenFree":false}',
  '{"id":247,"name":"Avalanche","brewery":"Fyne Ales","barCode":"B18a","barName":"Fyne Ales","barLocation":"National Hall","abv":"4.5","colour":"#dca001","style":"Session Blond Ale","styleImage":"Session Pale","dispenseMethod":"Cask","tags":["Cascade","Liberty","Wheat"],"notes":"Thirst-Quenching Pale. Bold and bracing like the Glen Fyne hills on a winter\'s morning, Avalanche is the quintessential, refreshing pale ale showcasing Cascade and Liberty hops. Punchy, clean citrus and grassy hop flavours with a balanced, bittersweet finish designed to quench the strongest of thirsts.","vegan":false,"glutenFree":false}',
  '{"id":248,"name":"Jarl","brewery":"Fyne Ales","barCode":"B18a","barName":"Fyne Ales","barLocation":"National Hall","abv":"3.8","colour":"#dca001","style":"Session Golden Ale","styleImage":"Session Pale","dispenseMethod":"Cask","tags":["Citra","Fruity"],"notes":"Citra Session Blonde. A showcase for American hop, Citra, Jarl delivers waves of fruity citrus flavours and a clean finish. Packed full of balanced, vibrant grapefruit and delicate lemon flavours with a subtly grassy, refreshing finish.","vegan":false,"glutenFree":false}',
  '{"id":249,"name":"Vital Spark","brewery":"Fyne Ales","barCode":"B18a","barName":"Fyne Ales","barLocation":"National Hall","abv":"4.4","colour":"#4b100c","style":"Old Ale","styleImage":"Red Ale","dispenseMethod":"Cask","tags":["Amarillo","Cascade","Wheat"],"notes":"A tribute to Loch Fyne\'s famous fictional ship, Vital Spark fuses two worlds; a traditional rich, dark malt base charged with new world Amarillo and Cascade hops. Rich, dark caramel malt flavours lifted by notes of hedgerow fruits and a short, refreshing finish.","vegan":false,"glutenFree":false}',
  '{"id":250,"name":"Hurricane Jack","brewery":"Fyne Ales","barCode":"B18a","barName":"Fyne Ales","barLocation":"National Hall","abv":"4.4","colour":"#dca001","style":"Session Blond Ale","styleImage":"Session Pale","dispenseMethod":"Cask","tags":["Cascade","Amarillo","Wheat"],"notes":"Blonde Ale with Character. A tribute to the finest fictional sailor to ever sail Loch Fyne, Hurricane Jack is a well-balanced blonde ale showcasing fruity Cascade and Amarillo hops on top of a pale malt base. Packed full of biscuity malts, balanced with sweet citrus and smooth floral notes, ending with a light bitterness.","vegan":false,"glutenFree":false}',
  '{"id":251,"name":"Off the Clock","brewery":"Fyne Ales","barCode":"B18a","barName":"Fyne Ales","barLocation":"National Hall","abv":"4.5","colour":"#ebc325","style":"Premium Pale Ale","styleImage":"American Ipa","dispenseMethod":"Cask","tags":["Grapefruit","Tangerine","Lemon","Pine","Cascade","Amarillo","Simcoe"],"notes":"Unwind with a well-deserved pint of our latest session IPA. Bright citrus flavours of grapefruit, tangerine, and lemon are complemented by subtle pine notes for a refreshing and rewarding finish.","vegan":false,"glutenFree":false}',
  '{"id":252,"name":"Highlander","brewery":"Fyne Ales","barCode":"B18a","barName":"Fyne Ales","barLocation":"National Hall","abv":"4.8","colour":"#b04500","style":"Premium Pale Ale","styleImage":"British Ipa","dispenseMethod":"Cask","tags":["Red","Caramel","Fruit","Wheat","Crystal"],"notes":"A nutty, caramel-malt body with sweet red fruit notes and a gently bitter finish. Not only was Highlander the first beer we ever brewed, it was first brewed on Scotland\'s national day, St Andrew\'s Day, so when we call it a traditional Scottish amber, we mean it. Highlander has been winning awards since day one - most recently picking up gold at the 2018 Society of Independent Brewers Scottish awards.","vegan":false,"glutenFree":false}',
  '{"id":253,"name":"Easy Trail","brewery":"Fyne Ales","barCode":"B18a","barName":"Fyne Ales","barLocation":"National Hall","abv":"4.2","colour":"#dca001","style":"British IPA","styleImage":"Session Pale","dispenseMethod":"KeyKeg","tags":["Berry","Citrus","Pine"],"notes":"Easy Trail\'s flavour profile is all about balance - delivering the perfect mix of juicy berry and clean citrus notes up front, with a refreshing finish showcasing crisp, piney notes. Easy Trail was created as a spin-off from the Workbench IPA project, taking lessons learned during our experiments with hops and applying them to a more session-able version of an IPA.","vegan":false,"glutenFree":false}',
  '{"id":254,"name":"In the Static","brewery":"Fyne Ales","barCode":"B18a","barName":"Fyne Ales","barLocation":"National Hall","abv":"4.4","colour":"#dca001","style":"New World IPA","styleImage":"Session Pale","dispenseMethod":"KeyKeg","tags":["Citrus","Papaya","Pineapple"],"notes":"A tropical symphony of flavours, where juicy papaya, succulent pineapple and tangy citrus take centre stage.","vegan":false,"glutenFree":false}',
  '{"id":255,"name":"Fyne Lager","brewery":"Fyne Ales","barCode":"B18a","barName":"Fyne Ales","barLocation":"National Hall","abv":"4.7","colour":"#dca001","style":"Speciality - Differently Produced Light","styleImage":"Session Pale","dispenseMethod":"KeyKeg","tags":["Citrus","Helles","Wheat","Pacific Gem","Motueka","Rakau","Golden"],"notes":"Modern Scottish Helles. Full-bodied modern helles lager, dry-hopped for subtle citrus flavours and a clean, crisp refreshing finish.","vegan":false,"glutenFree":false}',
  '{"id":256,"name":"Workbench","brewery":"Fyne Ales","barCode":"B18a","barName":"Fyne Ales","barLocation":"National Hall","abv":"5.5","colour":"#dca001","style":"New World IPA","styleImage":"Session Pale","dispenseMethod":"KeyKeg","tags":["Citrus","Melon","Grassy"],"notes":"For those who deserve a hop-forward, super-satisfying beer after a hard day\'s work; delivering the perfect balance of fruity new-world hop flavours and a thirst-quenching finish. Vibrant stone-fruit and melon flavours followed by a finish with light grassy, and citrus notes.","vegan":false,"glutenFree":false}',
  '{"id":257,"name":"Dark Mild","brewery":"Harvey\'s","barCode":"B18d","barName":"Harvey\'s","barLocation":"National Hall","abv":"3","colour":"#2d1410","style":"Mild","styleImage":"Brown Ale","dispenseMethod":"Cask","tags":["Dark","Brown","Caramel","Sweet","Chocolate","Coffee"],"notes":"Low alcohol, Malty and Mellow. Soft and slightly sweet with a dry, nutty aftertaste akin to an infusion of ground nuts. Refreshing, hydrating and comforting.","vegan":false,"glutenFree":false}',
  '{"id":258,"name":"Sussex Best Bitter","brewery":"Harvey\'s","barCode":"B18d","barName":"Harvey\'s","barLocation":"National Hall","abv":"4","colour":"#4b100c","style":"Session Bitter","styleImage":"Red Ale","dispenseMethod":"Cask","tags":["Hoppy","Bitter","Brown","Dry"],"notes":"Full-bodied brown bitter. A hoppy aroma leads to a good malt and hop balance, and a dry aftertaste. Using a blend of four local hops, water filtered through the Sussex Downs over 30 years, and Harvey\'s unique 60 year old yeast strain, Harvey\'s Best Bitter is the embodiment of Sussex.","vegan":false,"glutenFree":false}',
  '{"id":259,"name":"Armada","brewery":"Harvey\'s","barCode":"B18d","barName":"Harvey\'s","barLocation":"National Hall","abv":"4.3","colour":"#dca001","style":"Session Golden Ale","styleImage":"Session Pale","dispenseMethod":"Cask","tags":["Dry","Refreshing","Golden"],"notes":"Dry-hopped. A golden ale with a vibrant hop tone and a dry finish. Robust, refreshing and still a port of call in any beer-drinker’s voyage of discovery.","vegan":false,"glutenFree":false}',
  '{"id":260,"name":"Tom Paine","brewery":"Harvey\'s","barCode":"B18d","barName":"Harvey\'s","barLocation":"National Hall","abv":"5.5","colour":"#4b100c","style":"Premium Bitter","styleImage":"Red Ale","dispenseMethod":"Cask","tags":["Malty","Strong","Pale","Dry"],"notes":"A dry hopped, robust pale ale with a full, malty palate. Strong and well balanced, with hints of impending revolution...","vegan":false,"glutenFree":false}',
  '{"id":261,"name":"Imperial Stout","brewery":"Harvey\'s","barCode":"B18d","barName":"Harvey\'s","barLocation":"National Hall","abv":"9","colour":"#070b0c","style":"Strong Stout","styleImage":"Porter","dispenseMethod":"Cask","tags":["Coffee","Chocolate","Spicy","Warming"],"notes":"The roast, alcoholic and spicy notes combine in this unusually sweet and sour beer. Steeped in the depths of chocolate and coffee, this brew will improve and develop complexity up to one year.","vegan":false,"glutenFree":false}',
  '{"id":262,"name":"Prussian Pilsner","brewery":"Harvey\'s","barCode":"B18d","barName":"Harvey\'s","barLocation":"National Hall","abv":"4","colour":"#be7001","style":"Speciality - Differently Produced Light","styleImage":"Strong Blonde","dispenseMethod":"KeyKeg","tags":["Lubelski"],"notes":"Balanced, refreshing and distinctly moreish. Harvey\'s Pilsner showcases continental hops alongside local brewing innovation.","vegan":false,"glutenFree":false}',
  '{"id":263,"name":"Wharf IPA","brewery":"Harvey\'s","barCode":"B18d","barName":"Harvey\'s","barLocation":"National Hall","abv":"4.2","colour":"#be7001","style":"British IPA","styleImage":"Strong Blonde","dispenseMethod":"KeyKeg","tags":["Citrus"],"notes":"Modern heavily hopped IPA. Zesty and fragrant, this golden beer contains the very essence of our local hop gardens.","vegan":false,"glutenFree":false}',
  '{"id":264,"name":"Proper Job","brewery":"St Austell","barCode":"B18b","barName":"St Austell","barLocation":"National Hall","abv":"4.5","colour":"#b04500","style":"Premium Golden Ale","styleImage":"British Ipa","dispenseMethod":"Cask","tags":["Bitter","Citrus","Smooth","Dry","Refreshing","Golden","Grapefruit","Fruits"],"notes":"A smooth premium golden ale with pronounced citrus, resinous hop aroma. Powerful bitter and dry hop flavour on the tongue with pink grapefruit and lemon citrus, marmalade and some pineapple fruit dominating throughout. Crisp and refreshing finish with persisting bitter citrus and pineapple, remaining dry.","vegan":false,"glutenFree":false}',
  '{"id":265,"name":"Bath Ales Gem","brewery":"St Austell","barCode":"B18b","barName":"St Austell","barLocation":"National Hall","abv":"4.1","colour":"#b04500","style":"Session Bitter","styleImage":"British Ipa","dispenseMethod":"Cask","tags":["Caramel"],"notes":"Pale brown best bitter with sweet fruit and malt flavours and a hint of caramel. Little aroma but a balanced taste with a short bitter finish.","vegan":false,"glutenFree":false}',
  '{"id":266,"name":"Anthem","brewery":"St Austell","barCode":"B18b","barName":"St Austell","barLocation":"National Hall","abv":"3.8","colour":"#dca001","style":"Session Golden Ale","styleImage":"Session Pale","dispenseMethod":"Cask","tags":["Hoppy","Bitter","Light","Citrus","Smooth","Dry","Refreshing","Golden","Grapefruit","Astringency","Sweet","Fruits","Target","Olicana","Harlequin","Jester"],"notes":"A smooth, refreshing, light golden ale with an aroma of citrus and non-citrus fruits. Lemon, tangerine, grapefruit and peaches dominate the taste with concomitant bitterness and astringency. Hints of sweet malt are detectable. Dry, bitter and hoppy finish.","vegan":false,"glutenFree":false}',
  '{"id":267,"name":"Tribute","brewery":"St Austell","barCode":"B18b","barName":"St Austell","barLocation":"National Hall","abv":"4.2","colour":"#be7001","style":"Premium Golden Ale","styleImage":"Strong Blonde","dispenseMethod":"Cask","tags":["Hoppy","Bitter","Amber","Citrus","Smooth","Caramel","Biscuit","Sweet","Toffee","Refreshing"],"notes":"Amber bitter with malt, fruit and citrus hops in the aroma. Dominant hop bitterness with elderflower notes and smooth, silky biscuit malt balanced with sweet caramel and toffee tones with a crisp apple and citrus hoppy taste fading gently. A little dryness in the finish with a bitter sweet balance and lingering apple and citrus tones.","vegan":false,"glutenFree":false}',
  '{"id":268,"name":"Mena Dhu","brewery":"St Austell","barCode":"B18b","barName":"St Austell","barLocation":"National Hall","abv":"4.5","colour":"#070b0c","style":"Session Stout","styleImage":"Porter","dispenseMethod":"Cask","tags":["Bitter","Smooth","Rich","Plum","Liquorice","Bitter finish","Sweet","Toffee"],"notes":"Velvet-smooth black stout with roast malt nose. Rich, long-lasting roast and smoky malt flavour which is moderately bitter and sweet and carries toffee and liquorice notes. Hints of plum, raisins, dates and figs complete a satisfying full-bodied and complex stout - liquid Christmas pudding. Long roast malt and bitter finish. A subtle oak smoked aroma sets the scene for a delicious flavour profile that entices with a hint of dark chocolate, followed by a delicate touch of liquorice on the finish.","vegan":false,"glutenFree":false}',
  '{"id":269,"name":"Hicks","brewery":"St Austell","barCode":"B18b","barName":"St Austell","barLocation":"National Hall","abv":"5","colour":"#4b100c","style":"Premium Bitter","styleImage":"Red Ale","dispenseMethod":"Cask","tags":["Bitter","Floral","Smooth","Rich","Caramel","Sweet","Fruits","Strong","Progress","Golding"],"notes":"Tawny premium bitter with malt and stone fruit on the nose. Rich and pleasant malt flavour with caramel sweetness followed by robust hop and vine fruits, apple, caramel and bitterness. Very smooth drinking and satisfying beer. Malt and sweet fruit last into the long finish with floral esters. Brewed with plenty of malt and lashings of English Progress and Golding hops, Hicks is a truly classic ale of considerable depth and complexity.","vegan":false,"glutenFree":false}',
  '{"id":270,"name":"Big Job","brewery":"St Austell","barCode":"B18b","barName":"St Austell","barLocation":"National Hall","abv":"7.2","colour":"#b04500","style":"Premium Blond Ale","styleImage":"British Ipa","dispenseMethod":"Cask","tags":["Bitter","Fruity","Citrus","Smooth","Dry","Golden","Warming","Otter","Wheat"],"notes":"Golden beer with honey caramelised citrus notes, refreshingly smooth with warming finish. Increasing spicy dry bitter notes and soft fruity nose. It’s not subtle, but if you love the taste of big, powerful hops Big Job will be just the Job for you!","vegan":false,"glutenFree":false}',
  '{"id":271,"name":"Korev","brewery":"St Austell","barCode":"B18b","barName":"St Austell","barLocation":"National Hall","abv":"4.8","colour":"#ebc325","style":"Speciality - Differently Produced Light","styleImage":"American Ipa","dispenseMethod":"KeyKeg","tags":["Pale","Lager","Herbal","Honey","Maize","Magnum","Hersbrucker","Saaz"],"notes":"Born and bred in the heart of Cornwall, we brew its free-thinking spirit into our beer and take it with us wherever we go, whatever we do. Pale gold like the morning sun, fresh and crisp like a coastal breeze, full-on refreshment like waves crashing against our shores.","vegan":true,"glutenFree":false}',
  '{"id":272,"name":"Bath Ales Monterey","brewery":"St Austell","barCode":"B18b","barName":"St Austell","barLocation":"National Hall","abv":"3.9","colour":"#dca001","style":"New World IPA","styleImage":"Session Pale","dispenseMethod":"KeyKeg","tags":["Pine","Tropical"],"notes":"Full of pine and tropical notes, this pale ale was born but not raised in the USA thanks to its three American sourced hops. Destined for long, lazy afternoons, it’s a refreshing, flavourful and sessionable beer as golden as the sands of Monterey Bay.","vegan":false,"glutenFree":false}',
  '{"id":273,"name":"Jaipur","brewery":"Thornbridge","barCode":"B18e","barName":"Thornbridge","barLocation":"National Hall","abv":"5.9","colour":"#dca001","style":"British IPA","styleImage":"Session Pale","dispenseMethod":"Cask","tags":["Chinook","Centennial","Columbus","Simcoe","Ahtanum","Cascade"],"notes":"A fantastic experience of grapefruit, lemon and tropical fruit with an enticing bitterness. A great English malt base of Low Colour Maris Otter from Norfolk that helps keep the beer light and drinkable with enough sweetness to keep it all in harmony.","vegan":false,"glutenFree":false}',
  '{"id":274,"name":"Wild Swan","brewery":"Thornbridge","barCode":"B18e","barName":"Thornbridge","barLocation":"National Hall","abv":"3.4","colour":"#ebc325","style":"Session Blond Ale","styleImage":"American Ipa","dispenseMethod":"Cask","tags":["Crystal","Chinook","Amarillo"],"notes":"White gold in colour and pours with a pure white head. It has aromas of light bitter lemon with a hint of herb and subtle spiciness. Light bodied and easy drinking the flavours are crisp and dry with a lingering citrus, hoppy finish. Summer in a glass!","vegan":false,"glutenFree":false}',
  '{"id":275,"name":"Lord Marples","brewery":"Thornbridge","barCode":"B18e","barName":"Thornbridge","barLocation":"National Hall","abv":"4","colour":"#4b100c","style":"Session Bitter","styleImage":"Red Ale","dispenseMethod":"Cask","tags":["Bitter","Smooth","Coffee","Bitter finish","Caramel","Goldings","Maris Otter","Caramalt","Crystal","Chocolate"],"notes":"Smooth, traditional, easy-drinking bitter. Caramel, malt and coffee flavours fall away to leave a long, bitter finish. An attractive mahogany, bringing forth flavours of honey and caramel with just a light bitterness in the finish to keep it balanced.","vegan":false,"glutenFree":false}',
  '{"id":276,"name":"Brother Rabbit","brewery":"Thornbridge","barCode":"B18e","barName":"Thornbridge","barLocation":"National Hall","abv":"4","colour":"#ebc325","style":"Session Blond Ale","styleImage":"American Ipa","dispenseMethod":"Bottle","tags":["Hoppy","Maris Otter","Wheat"],"notes":"Contains a fantastic Norfolk malt which gives a great base to the beer and a lightly resinous character, the hops present a fantastic, punchy, lemon flavour with grassy hints. Brother Rabbit pours lemon zest in colour with a clean, hoppy aroma. A dry palate, resinous finish and some bitterness make it a great session beer.","vegan":true,"glutenFree":false}',
  '{"id":277,"name":"Tiramisu Lucaria","brewery":"Thornbridge","barCode":"B18e","barName":"Thornbridge","barLocation":"National Hall","abv":"4.5","colour":"#070b0c","style":"Speciality - Flavoured Dark","styleImage":"Porter","dispenseMethod":"Cask","tags":["Bramling Cross","Wheat","Chocolate"],"notes":"The story goes that the legendary Tiramisu was created in the 1960s in the north of Italy and has since been enjoyed around the World. The beauty of this dish lies in its spectrum of flavours and textures, with the sponge and soft mascarpone providing a contrast for the roasted coffee and indulgent dark cocoa. This iteration of the Pardus series provided a fun challenge as we strived to do justice to such a renowned dessert and Thornbridge think they have captured the flavours perfectly","vegan":false,"glutenFree":false}',
  '{"id":278,"name":"Coltrane","brewery":"Thornbridge","barCode":"B18e","barName":"Thornbridge","barLocation":"National Hall","abv":"5","colour":"#b04500","style":"Brown Ale","styleImage":"British Ipa","dispenseMethod":"Cask","tags":["Citrus","Rich"],"notes":"This beer pours deep and rich whilst the American hops provide a huge fresh burst of citrus flavours creating a great balance of flavours.","vegan":false,"glutenFree":false}',
  '{"id":279,"name":"Scrawler","brewery":"Beer Ink","barCode":"B2","barName":"The Town Mouse","barLocation":"Grand Hall","abv":"5","colour":"#b04500","style":"British IPA","styleImage":"British Ipa","dispenseMethod":"KeyKeg","tags":["Hoppy","Bitter","Bitter finish"],"notes":"Packed with Nugget hops with an abundance of late addition Simcoe and Amarillo this IPA has flavours of bitter citric fruits, resinous piney qualities and an underlying tropical fruitiness.","vegan":true,"glutenFree":false}',
  '{"id":280,"name":"On the Saison","brewery":"Beer Ink","barCode":"B2","barName":"The Town Mouse","barLocation":"Grand Hall","abv":"3.6","colour":"#dca001","style":"Speciality - Differently Produced Light","styleImage":"Session Pale","dispenseMethod":"KeyKeg","tags":[],"notes":"Mango tea saison","vegan":true,"glutenFree":false}',
  '{"id":281,"name":"Imbongo","brewery":"Boundary","barCode":"B2","barName":"The Town Mouse","barLocation":"Grand Hall","abv":"5.5","colour":"#b04500","style":"British IPA","styleImage":"British Ipa","dispenseMethod":"KeyKeg","tags":["Pale","Tropical"],"notes":"A tropical IPA with Extra pale malt and hop blends of Mosaic &amp; Azacca.","vegan":true,"glutenFree":false}',
  '{"id":282,"name":"My Milk Stout Brings all the Bulls to the Yard","brewery":"Brentwood (Elephant School)","barCode":"B2","barName":"The Town Mouse","barLocation":"Grand Hall","abv":"4.5","colour":"#070b0c","style":"Session Stout","styleImage":"Porter","dispenseMethod":"KeyKeg","tags":["Stout","Session","Chocolate","Caramel","Coffee"],"notes":"Chocolate, caramel, coffee and dried fruit collide with the roasted biscuity malt to produce a complex and smooth milk stout.","vegan":false,"glutenFree":true}',
  '{"id":283,"name":"Falcon Punch","brewery":"Brentwood (Elephant School)","barCode":"B2","barName":"The Town Mouse","barLocation":"Grand Hall","abv":"5.1","colour":"#ebc325","style":"British IPA","styleImage":"American Ipa","dispenseMethod":"KeyKeg","tags":["Golden","Fuity","Hoppy"],"notes":"IPA with fruity hoppy punch, low in bitterness and very refreshing.","vegan":false,"glutenFree":true}',
  '{"id":284,"name":"Dark Necessities","brewery":"Burning Soul","barCode":"B2","barName":"The Town Mouse","barLocation":"Grand Hall","abv":"5.2","colour":"#070b0c","style":"Strong Stout","styleImage":"Porter","dispenseMethod":"KeyKeg","tags":[],"notes":"A straight up stout with no baking ingredients to be found. Thick and heavy.","vegan":true,"glutenFree":false}',
  '{"id":285,"name":"boring.moon.water","brewery":"Burning Soul","barCode":"B2","barName":"The Town Mouse","barLocation":"Grand Hall","abv":"5.5","colour":"#ebc325","style":"New World IPA","styleImage":"American Ipa","dispenseMethod":"KeyKeg","tags":["IPA","hazy"],"notes":"Very hazy NEIPA, packed with hops, a over the top take on the ever popular NEIPA","vegan":true,"glutenFree":false}',
  '{"id":286,"name":"Pop Up!","brewery":"Cronx","barCode":"B2","barName":"The Town Mouse","barLocation":"Grand Hall","abv":"5","colour":"#b04500","style":"Premium Pale Ale","styleImage":"British Ipa","dispenseMethod":"KeyKeg","tags":["Hoppy","Bitter","Strong","Amber","Smooth","Pale","Dry","Grapefruit","Tropical","American"],"notes":"Smooth, amber coloured American Pale Ale. Strong tropical and grapefruit throughout. Hoppy and bitter on the palate and dry finish. Just a trace of sweetness.","vegan":true,"glutenFree":false}',
  '{"id":287,"name":"Entire","brewery":"Cronx","barCode":"B2","barName":"The Town Mouse","barLocation":"Grand Hall","abv":"5.2","colour":"#070b0c","style":"Strong Porter","styleImage":"Porter","dispenseMethod":"KeyKeg","tags":["Dark","Brown","Chocolate","Porter"],"notes":"Dark brown porter with chocolate roast notes in the aroma, flavour and finish. The fruit character is of caramelised raisins and plums","vegan":true,"glutenFree":false}',
  '{"id":288,"name":"Pando","brewery":"Double Barrelled","barCode":"B2","barName":"The Town Mouse","barLocation":"Grand Hall","abv":"4.8","colour":"#dca001","style":"Session Pale Ale","styleImage":"Session Pale","dispenseMethod":"KeyKeg","tags":["Pale","Session"],"notes":"Pale Ale that stands tall in the crowd. Brewed in our house style with Bru-1 and Citra Cryo Hops, this gives us a punchy mix of aromas and flavours of pineapple and passionfruit. There’s a slight bitterness on the finish to keep this tasty Pale session friendly – ideal for this time of year.","vegan":true,"glutenFree":false}',
  '{"id":289,"name":"Scenic Route","brewery":"Double Barrelled","barCode":"B2","barName":"The Town Mouse","barLocation":"Grand Hall","abv":"5.8","colour":"#b04500","style":"British IPA","styleImage":"British Ipa","dispenseMethod":"KeyKeg","tags":["IPA","Citrus","Mosaic","Tropical","Pine"],"notes":"Discover notes of sweet stonefruits, uplifting aromas of citrus and pine arriving from the Mosaic, and those undeniable juicy and tropical flavours from Galaxy waiting around the corner.","vegan":true,"glutenFree":false}',
  '{"id":290,"name":"Sunset Rider","brewery":"Elusive","barCode":"B2","barName":"The Town Mouse","barLocation":"Grand Hall","abv":"3.8","colour":"#dca001","style":"Session Pale Ale","styleImage":"Session Pale","dispenseMethod":"KeyKeg","tags":["Pale"],"notes":"Sunset Rider is a Transatlantic Pale Ale showcasing one British and one American hop on a rotational basis. At 3.8% ABV it’s highly sessionable with balanced bitterness and a pronounced hop flavour and aroma.","vegan":true,"glutenFree":false}',
  '{"id":291,"name":"Imperial Morrisman","brewery":"Elusive","barCode":"B2","barName":"The Town Mouse","barLocation":"Grand Hall","abv":"11","colour":"#070b0c","style":"Strong Stout","styleImage":"Porter","dispenseMethod":"KeyKeg","tags":["Chocolate","Dry","strong"],"notes":"A collaboration with Tim Lloyd and the mysterious Emperor\'s Brewery to amp up the award winning TV famous Morrisman Double Dry Chocolate Stout to imperial strength then added even more chocolate before adding loads more just for the hell of it!","vegan":true,"glutenFree":false}',
  '{"id":292,"name":"Bourbon Barrel Aged Imperial Morrisman","brewery":"Elusive","barCode":"B2","barName":"The Town Mouse","barLocation":"Grand Hall","abv":"11","colour":"#070b0c","style":"Strong Stout","styleImage":"Porter","dispenseMethod":"KeyKeg","tags":["Bourbon","Chocolate","Stout"],"notes":"We collaborated with Tim Lloyd and the mysterious Emperor’s Brewery to amp up our award winning TV famous Morrisman Double Dry Chocolate Stout to imperial strength then added even more chocolate before adding loads more just for the hell of it! To create this special edition it was blended with a portion of the 2021 release that had been aged in a Heaven Hill Bourbon barrel with the 2023 release to give it subtle notes of bourbon.","vegan":true,"glutenFree":false}',
  '{"id":293,"name":"Hefeweizen","brewery":"Geipel","barCode":"B2","barName":"The Town Mouse","barLocation":"Grand Hall","abv":"5.2","colour":"#be7001","style":"Speciality - Differently Produced Light","styleImage":"Strong Blonde","dispenseMethod":"KeyKeg","tags":["Golden","Wheat beer"],"notes":"“HEF-uh-VYT-zen” is the traditional cloudy wheat beer of Bavaria. “Hefe” means yeast and “weizen” means wheat in German. With at least 50% wheat malt, it has a very different flavour to barley based beers. But it’s the unique yeast that gives it a cloudy appearance and unusual flavours of banana, bubblegum, clove and coriander. The yeast is top-fermenting at ale (warm) temperatures but the results must be lagered (cold conditioned) for best results. Hefeweizens normally have low bitterness, high carbonation and taste great in the Summer with a slice of lemon.","vegan":true,"glutenFree":false}',
  '{"id":294,"name":"Zeppelin","brewery":"Geipel","barCode":"B2","barName":"The Town Mouse","barLocation":"Grand Hall","abv":"2.8","colour":"#ebc325","style":"Speciality - Differently Produced Light","styleImage":"American Ipa","dispenseMethod":"KeyKeg","tags":["Lager"],"notes":"Alcohol contributes a distinct flavour to beer that is obvious when it’s missing. This is especially true in a subtly flavoured style like Pilsner. We set out to produce a delicious lager for those seeking to reduce alcohol intake. Lighter than you would think, the Zeppelin airship is a fitting emblem of our low-ABV Pilsner.","vegan":true,"glutenFree":false}',
  '{"id":295,"name":"Boogie Van","brewery":"Hackney","barCode":"B2","barName":"The Town Mouse","barLocation":"Grand Hall","abv":"5.5","colour":"#ebc325","style":"New World IPA","styleImage":"American Ipa","dispenseMethod":"KeyKeg","tags":["Smooth","Refreshing","Caramel","Tropical","Sweet","Fruits","New World","New World IPA"],"notes":"Gold coloured New World IPA that has tropical fruits and resinous piney hops on the nose and flavour, which is sweet and smooth with a hint of caramel. There is a gentle bitterness which is noticeable in the fairly short, refreshing aftertaste. Mosaic, Azacca, Equinox hops; Munich malt; USA 5 yeast.","vegan":true,"glutenFree":false}',
  '{"id":296,"name":"Millions of Peaches","brewery":"Hackney","barCode":"B2","barName":"The Town Mouse","barLocation":"Grand Hall","abv":"4","colour":"#be7001","style":"Speciality - Flavoured Light","styleImage":"Strong Blonde","dispenseMethod":"KeyKeg","tags":["Basil","Peaches","Sharp","Hackney","London"],"notes":"Millions of Peaches, infused with basil and a heavy load of sweet peaches, accentuated with a sharp, kettle-sour base.","vegan":true,"glutenFree":false}',
  '{"id":297,"name":"Crowstone","brewery":"Leigh on Sea","barCode":"B2","barName":"The Town Mouse","barLocation":"Grand Hall","abv":"5.5","colour":"#2d1410","style":"Black IPA","styleImage":"Brown Ale","dispenseMethod":"KeyKeg","tags":["Dark","Rich","Essex","Bitter","Aroma"],"notes":"Dark like a stout, but hoppy and bitter in flavour like an IPA! A rich blend of malts gives Crowstone its intensely dark, almost black colour, while serious quantities of fresh New World hops provide tropical citrus flavour and aroma. The Crowstone, at Chalkwell, is the north bank Thames “London Stone” marking the ancient limit of the port of London.","vegan":true,"glutenFree":false}',
  '{"id":298,"name":"SS9","brewery":"Leigh on Sea","barCode":"B2","barName":"The Town Mouse","barLocation":"Grand Hall","abv":"9","colour":"#070b0c","style":"Strong Stout","styleImage":"Porter","dispenseMethod":"KeyKeg","tags":["Leigh on Sea","Stout","Coffee","Dark malt","Chocolate","Essex"],"notes":"SS9 is a seriously strong stout characterised by deep boozy notes of coffee and chocolate from the range of dark malts used in the recipe. Perfect for colder nights and warm fireplaces.","vegan":true,"glutenFree":false}',
  '{"id":299,"name":"Bust Le Milli","brewery":"Mad Squirrel","barCode":"B2","barName":"The Town Mouse","barLocation":"Grand Hall","abv":"8","colour":"#070b0c","style":"Speciality - Flavoured Dark","styleImage":"Porter","dispenseMethod":"KeyKeg","tags":["Salted","Roast","Stout","Caramel"],"notes":"Double Salted Caramel Stout - the essence of decadence, the flavour of luxury and the sweet treat of millionaires, but double it! Double the salt, double the caramel and double the silky smoothness. Expect subtle roasty flavours with sweet caramel notes and a sprinkle of sea salt. Bringing back the dessert you can drink!","vegan":false,"glutenFree":false}',
