  '{"id":685,"name":"10","brewery":"Rochefort","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"11.3","colour":"#2d1410","style":"International Beer","styleImage":"Brown Ale","dispenseMethod":"Bottle","tags":["Trappist","Dark","Caramel"],"notes":"One of the best beers available. Dark, rich and sumptious. A real finisher or house beer","vegan":false,"glutenFree":false}',
  '{"id":686,"name":"8","brewery":"Rochefort","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"8","colour":"#4b100c","style":"International Beer","styleImage":"Red Ale","dispenseMethod":"Bottle","tags":["Trappist","Fruit"],"notes":"Lighter to drink than the 10 but no less complex. Lighter sweet fruit flavours and malt tones","vegan":false,"glutenFree":false}',
  '{"id":687,"name":"6","brewery":"Rochefort","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"7.5","colour":"#b04500","style":"International Beer","styleImage":"British Ipa","dispenseMethod":"Bottle","tags":["Orange","Trappist"],"notes":"Pours orange brown with a tan head. Sweet tea and fruit aroma. Carbonation is very lively. Finishes with faint notes of dark fruit.","vegan":false,"glutenFree":false}',
  '{"id":688,"name":"Heritage Quad","brewery":"Straffe Hendrik","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"11","colour":"#4b100c","style":"International Beer","styleImage":"Red Ale","dispenseMethod":"Bottle","tags":["Trappist"],"notes":"A very good quad that benefits from barrel aging - we arent sure what year the supplier has so no notes presently.","vegan":false,"glutenFree":false}',
  '{"id":689,"name":"BibiPils","brewery":"Bibibir","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"4.9","colour":"#dca001","style":"International Beer","styleImage":"Session Pale","dispenseMethod":"Can","tags":["Pilsner","Honey","Spicy","Citrus"],"notes":"Inspired by Franconian Pils. Brewed with 100% German Pilsner malt which gives it elegant honey notes. The generous 100% Tettnanger hops also give it a herbaceous, slightly spicy and citrusy scent and flavour.","vegan":false,"glutenFree":false}',
  '{"id":690,"name":"American Ipa","brewery":"Bibibir","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"6.5","colour":"#ebc325","style":"International Beer","styleImage":"American Ipa","dispenseMethod":"KeyKeg","tags":["IPA","Hoppy","Citrus"],"notes":"Inspired by the American West Coast IPAs: clear, dry, very hoppy, a mix of aromas and flavors ranging from topical to citrus. The bitterness is intense but never intrusive. 6.5 degrees that you can\'t feel, to drink in buckets.","vegan":false,"glutenFree":false}',
  '{"id":691,"name":"Non Ci Vedo Più","brewery":"Bibibir","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"10.5","colour":"#070b0c","style":"International Beer","styleImage":"Porter","dispenseMethod":"KeyKeg","tags":["Stout","Vanilla"],"notes":"Imperial Stout with marked roasted notes of cocoa, vanilla and licorice. The drink is rich, intense, dense and velvety, the initial sweetness gives way to a balanced dry and bitter finish. 10.5 degrees well hidden.","vegan":false,"glutenFree":false}',
  '{"id":692,"name":"Novapils","brewery":"Birranova","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"5","colour":"#ebc325","style":"International Beer","styleImage":"American Ipa","dispenseMethod":"Can","tags":["Pale Ale","Floral"],"notes":"Pale straw yellow beer. On the nose there are herbaceous and floral notes typical of the hops used. Pleasant and thirst-quenching in the mouth with a good American contribution that stimulates drinking.","vegan":false,"glutenFree":false}',
  '{"id":693,"name":"Check Point","brewery":"Birranova","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"6.5","colour":"#ebc325","style":"International Beer","styleImage":"American Ipa","dispenseMethod":"Can","tags":["Citrus"],"notes":"Checkpoint is the moment of evaluation: concentrate, uncork, observe the foam\'s structure, take a sip, verify the cereal body, check the citrus and resinous notes from the American hops. If everything meets your expectations, the checkpoint is successful and you\'re ready to proceed to the next sip!","vegan":false,"glutenFree":false}',
  '{"id":694,"name":"Brett Farmand","brewery":"BrewFist","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"6.1","colour":"#ebc325","style":"International Beer","styleImage":"American Ipa","dispenseMethod":"Keg","tags":["Collaboration","Citra","Citrus"],"notes":"Collaboration with Maestri del Sannio, this brew that showcases the art of brewing. With a blend of Brettanomyces and Saccharomyces yeasts, it offers complexity. Simcoe, Citra, and Eldorado hops create layers of depth, refreshing bitterness, and fruity notes. Experience the craftsmanship and raw material synergy.","vegan":false,"glutenFree":false}',
  '{"id":695,"name":"U Baccarossa","brewery":"Ca\' del Brado","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"7.9","colour":"#4b100c","style":"International Beer","styleImage":"Red Ale","dispenseMethod":"Bottle","tags":[],"notes":"The IGA (Italian Grape Ale) is made with 10% Centesimino grapes from the natural winemaker Ancarani. The must was subjected to a spontaneous fermentation environment coming from the grapes, along with the inoculation of brettanomyces. The beer was refided for 6/7 months in barrels with the skins in undergoing maceration.","vegan":false,"glutenFree":false}',
  '{"id":696,"name":"Euroblend","brewery":"Ca\' Del Brado","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"7","colour":"#4b100c","style":"International Beer","styleImage":"Red Ale","dispenseMethod":"Bottle","tags":["Collaboration","Bourbon"],"notes":"This beer is a collaboration between Freigeist Bierkultur (Germany) and Brekeriet Beer AB (Sweden). It consists of a blend of different beers, with 50% being fermented with Brettanomyces Bruxellensis and aged in open vats for 5 months. Another 25% is a spontaneously fermented beer aged for 15 months in bourbon barrels from Brekeriet. The remaining 25% comes from a 100% smoked malt beer, spontaneous fermentation and one year in barrel (Freigeist).","vegan":false,"glutenFree":false}',
  '{"id":697,"name":"Berliner Weisse","brewery":"Canediguerra","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"3.2","colour":"#dca001","style":"International Beer","styleImage":"Session Pale","dispenseMethod":"Bottle","tags":["Cereal","Spices"],"notes":"Sour wheat beer with a centuries-old tradition. Straw yellow in color, moderate acidity, elegant and light body, the version we propose has a characteristic flavor of cereals and spices.","vegan":false,"glutenFree":false}',
  '{"id":698,"name":"Saison","brewery":"Canediguerra","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"6.4","colour":"#ebc325","style":"International Beer","styleImage":"American Ipa","dispenseMethod":"Bottle","tags":["Spicy","Herbal"],"notes":"The ancient seasonal beer of Belgian countryside workers is known for its refreshing nature despite its alcohol content, which is achieved through a light body and a pronounced and fresh hopping. The beer\'s distinctive character is derived from the unique yeast, which gives a spicy aroma.","vegan":false,"glutenFree":false}',
  '{"id":699,"name":"Round Overnight Lamponi","brewery":"Collerosso","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"6","colour":"#b04500","style":"International Beer","styleImage":"British Ipa","dispenseMethod":"Bottle","tags":["Lambic"],"notes":"A blend of three spontaneous fermentations from different years, to which half a ton of raspberries (on 1200lt) is added and left to macerate for a month. Complex, rich and intriguing.","vegan":false,"glutenFree":false}',
  '{"id":700,"name":"Arance Meccaniche","brewery":"Donkey","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"5.5","colour":"#ebc325","style":"International Beer","styleImage":"American Ipa","dispenseMethod":"Bottle","tags":["Pale Ale","Citrus","American"],"notes":"The name of this beer is inspired by the famous film \\\"A Clockwork Orange\\\". It is an American Pale Ale infused with the flavors of Abruzzo, personalized with Fossacesia oranges.","vegan":false,"glutenFree":false}',
  '{"id":701,"name":"Negroni","brewery":"Extraomnes","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"9.4","colour":"#4b100c","style":"null","styleImage":"Red Ale","dispenseMethod":"null","tags":["Citrus","Balasmic","Dry"],"notes":"Collaboration with Brasserie Fantôme. A beer that wanted to recall one of the most famous cocktails in the world in its appearance and aromas. Red color, citrus notes of orange and balsamic notes of juniper and hot spices. In the mouth you feel the alcohol tempered by a good softness and a dry, slightly bitter and vegetal finish with hints of artemisia.","vegan":false,"glutenFree":false}',
  '{"id":702,"name":"Gallagher Stout","brewery":"Hilltop","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"5.5","colour":"#070b0c","style":"International Beer","styleImage":"Porter","dispenseMethod":"Cask","tags":["Stout","Irish"],"notes":"An Irish stout with smoked Irish seaweed (dulse) and bitterness around 40 IBUs. Stylistically coherent, it has a good structure, while maintaining great simplicity of drinking.","vegan":false,"glutenFree":false}',
  '{"id":703,"name":"Italian Pils","brewery":"Humus","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"5","colour":"#ebc325","style":"International Beer","styleImage":"American Ipa","dispenseMethod":"Can","tags":["Pilsner","Honey"],"notes":"The Italian Pilsner differ slightly from the classic German Pils for a more accentuated use of hops especially from the point of aromatic view, characterizing the drink with floral, herbaceous and slightly fruity notes. A balanced and drinkable beer, born for celebrate the extraordinary beauty of everyday life.","vegan":false,"glutenFree":false}',
  '{"id":704,"name":"Sunnyday","brewery":"Humus","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"5.3","colour":"#c2c2c2","style":"International Beer","styleImage":"Other","dispenseMethod":"Cask","tags":["Hoppy","Citrus","Tropical"],"notes":"An extremely simple grist of malts and American hops Mosaic and Amarillo. The light cereal notes are overlaid by a basket of citrus and tropical fruits. Carefree drinking in a slender body.","vegan":false,"glutenFree":false}',
  '{"id":705,"name":"Sunnyday","brewery":"Humus","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"5.3","colour":"#ebc325","style":"International Beer","styleImage":"American Ipa","dispenseMethod":"Can","tags":["Citrus","Tropical","Hoppy"],"notes":"It features an extremely simple grist of malts and American hops, specifically Mosaic and Amarillo. The light cereal notes are overlaid by a basket of citrus and tropical fruits. It offers a carefree drinking with its slender body.","vegan":false,"glutenFree":false}',
  '{"id":706,"name":"Gose Buskers","brewery":"La Casa di Cura","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"4.5","colour":"#c2c2c2","style":"International Beer","styleImage":"Other","dispenseMethod":"Bottle","tags":["Grape"],"notes":"Gose Grape Ale with Montonico (Italian white grape variety, originally from Abruzzo) grape must from the Indigeno winery.","vegan":false,"glutenFree":false}',
  '{"id":707,"name":"Skizo","brewery":"La Casa di Cura","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"5.5","colour":"#dca001","style":"International Beer","styleImage":"Session Pale","dispenseMethod":"Bottle","tags":["Tea","Sour","Saison"],"notes":"Fermented apple tea, barley malt, hop wheat, sugar and yeast are the raw materials. On the label the superhero Skizo usually \\\"crazy\\\" but ready to become a champion of well-being and wear the magical apple-shaped hat (the bacteria that make up scoby are part of the schizomycete family)!","vegan":false,"glutenFree":false}',
  '{"id":708,"name":"MonTac","brewery":"La Casa di Cura","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"5.5","colour":"#4b100c","style":"International Beer","styleImage":"Red Ale","dispenseMethod":"Bottle","tags":["Saison","Grape","Spicy"],"notes":"Born from the encounter between the La Casa di Cura brewery and the Indigeno winery, it\'s a blend between TAC (a Saison style beer) and Montepulciano d\'Abruzzo grapes must. Spicy aromas of pepper together with winy notes and a light acidity that makes the drink smooth.","vegan":false,"glutenFree":false}',
  '{"id":709,"name":"Mezza TSO G-Free","brewery":"La Casa di Cura","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"3.5","colour":"#ebc325","style":"International Beer","styleImage":"American Ipa","dispenseMethod":"Bottle","tags":["Session","Citrus"],"notes":"Showcases intensely fruity American hops. The taste is of good intensity, light malty notes at the beginning followed by citrus and pineapple. It glides off lightly with great drinkability and a medium dry finish. Medium body and lively carbonation.","vegan":false,"glutenFree":true}',
  '{"id":710,"name":"TSO","brewery":"La Casa di Cura","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"3.5","colour":"#dca001","style":"International Beer","styleImage":"Session Pale","dispenseMethod":"Bottle","tags":["Malt"],"notes":"TSO is not only an IPA; it is also an idea. A top-fermented beer that will always remail single-malt, single-hop and single-spice. Additionally, each batch will be unique.","vegan":false,"glutenFree":false}',
  '{"id":711,"name":"Panda Tries Porn","brewery":"Luppolajo","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"8","colour":"#c2c2c2","style":"International Beer","styleImage":"Other","dispenseMethod":"Can","tags":["Bergamot","Golden"],"notes":"Golden and opalescent beer with unmalted wheat and rolled oats. The note of cereal is evident accompanied by spicy and citrus scents conferred by the bergamot in cold infusion. In the mouth it is sweet and rich with a balanced body.","vegan":false,"glutenFree":false}',
  '{"id":712,"name":"Smoking Ganja In A Police Station","brewery":"Luppolajo","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"4.5","colour":"#dca001","style":"International Beer","styleImage":"Session Pale","dispenseMethod":"Can","tags":[],"notes":"Combines the notes of malt and oak-smoked wheat with the resinous notes of hemp tops, inserted in cold infusion. The result is a very particular beer, a mix of flavors ranging from herbaceous to spicy hints.","vegan":false,"glutenFree":false}',
  '{"id":713,"name":"Tommaso Durello","brewery":"Maestri del Sannio","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"12","colour":"#070b0c","style":"International Beer","styleImage":"Porter","dispenseMethod":"Bottle","tags":["Barley Wine"],"notes":"Barley Wine produced in 2018 by Armando Romito and Vincenzo Cillo and then aged in a Thomas Hardy cask owned by Gianluca Polini. Powerful and ingenious in every respect!","vegan":false,"glutenFree":false}',
  '{"id":714,"name":"Boschetto","brewery":"Mister B","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"7.5","colour":"#dca001","style":"International Beer","styleImage":"Session Pale","dispenseMethod":"Can","tags":["Fruity","Sour"],"notes":"From the collaboration with the friends of Birrificio dei Castelli, it is made with the addition of rhubarb and wild strawberries. Produced with a blend of lactic acid bacteria and a long kettle sour, it is simultaneously soft, acidic, sweet but also savory in the finish.","vegan":false,"glutenFree":false}',
  '{"id":715,"name":"Bamba","brewery":"Mister B","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"6.3","colour":"#dca001","style":"International Beer","styleImage":"Session Pale","dispenseMethod":"Can","tags":["Citra","Citrus"],"notes":"Ekuanot, Citra, Azacca hops for an exotic and slightly bitter beer, with a secret ingredient: lots of cold-brewed lupulin powder, amazing!","vegan":false,"glutenFree":false}',
  '{"id":716,"name":"Abruxensis Sour IPA Styrian Golding","brewery":"Opperbacco","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"5.8","colour":"#b04500","style":"null","styleImage":"British Ipa","dispenseMethod":"null","tags":["Sour"],"notes":"The beer is made with raw materials from Abruzzo and utilizes selected yeasts obtained from local grapes in collaboration with the University of Teramo. A mix of Saccharomyces and Torulaspora start the fermentation, followed by the inoculation of two strains of Brettanomyces.","vegan":false,"glutenFree":false}',
  '{"id":717,"name":"Nature Terre Recchiuti","brewery":"Opperbacco","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"7.2","colour":"#dca001","style":"International Beer","styleImage":"Session Pale","dispenseMethod":"Bottle","tags":["Amber","Grape"],"notes":"Produced with the spontaneous fermentation of Montepulciano d\'Abruzzo grapes, which give the product an aroma close to natural wines, with a characteristic acidulous finish. Fermentation and maturation (12 months) take place in oak barrels.","vegan":false,"glutenFree":false}',
  '{"id":718,"name":"Cotta Numero 1","brewery":"Opperbacco","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"11","colour":"#b04500","style":"International Beer","styleImage":"British Ipa","dispenseMethod":"Bottle","tags":["Caramel"],"notes":"“Birra cotta” (cooked beer) inspired by cooked wine and produced with the same technique. The six hours of boiling, caramelizing the wort, give it a dark red color despite the use of only pale malts.","vegan":false,"glutenFree":false}',
  '{"id":719,"name":"Abruxensis Fiori di Acacia e Sambuco","brewery":"Opperbacco","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"5.2","colour":"#dca001","style":"International Beer","styleImage":"Session Pale","dispenseMethod":"Bottle","tags":["Elderflower","Fragrant","Sour"],"notes":"Fermentation and maturation take place in barriques previously used for the finest Montepulciano d\'Abruzzo wine. In this version, elderflower and acacia flowers have been used, harnessing the microflora present on the petals. With a golden straw color, it is a dry and refreshing beer, very fragrant. The floral notes are well balanced with the acidic and lactic scents typical of the style.","vegan":false,"glutenFree":false}',
  '{"id":720,"name":"The Rock","brewery":"Rock","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"6.5","colour":"#b04500","style":"International Beer","styleImage":"British Ipa","dispenseMethod":"Cask","tags":["Bitter","Italy"],"notes":"The frontman of our band. Biting voice and captivating stage presence, The Rock is our most loved beer. The final bitter note balances the aroma of the hops and completes the drinking experience.","vegan":false,"glutenFree":false}',
  '{"id":721,"name":"Liquid Barrel","brewery":"Siemàn","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"6.2","colour":"#ebc325","style":"International Beer","styleImage":"American Ipa","dispenseMethod":"Cask","tags":["Wild Ale","Ekuanot","Citra","Simcoe","Mosaic"],"notes":"Collaboration with Liquida Brewery. A Wild Ale that combines the funky component of long barrel maturation with the freshness and power of American hops (Ekuanot, Citra, Simcoe and Mosaic) used also in dry hopping.","vegan":false,"glutenFree":false}',
  '{"id":722,"name":"Incrocio Bianco","brewery":"Siemàn","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"6.3","colour":"#be7001","style":"International Beer","styleImage":"Strong Blonde","dispenseMethod":"Cask","tags":["Italy","OAk aged"],"notes":"Ferments and ages for 12 months in oak barrels with our indigenous yeasts. At the end of maturation, we add directly into the barrels our Garganega, Tai Bianco and Incrocio Manzoni grapes that we grow on the Berici Hills. The maturation in barrel together with the grapes continues for another 3 months.","vegan":false,"glutenFree":false}',
  '{"id":723,"name":"Mrs White","brewery":"The Wall","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"4.5","colour":"#be7001","style":"International Beer","styleImage":"Strong Blonde","dispenseMethod":"Cask","tags":["Italy","IPA","Orange","Coriander"],"notes":"White IPA flavored with bitter orange peel and coriander. Pale yellow in color, it is fragrant and has a citrus flavour. Thirst-quenching and drinkable thanks to the low alcohol content, the bitterness and the freshness given by the wheat and spices.","vegan":false,"glutenFree":false}',
  '{"id":724,"name":"John Hops","brewery":"The Wall","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"8.8","colour":"#dca001","style":"International Beer","styleImage":"Session Pale","dispenseMethod":"Cask","tags":["Lager","Exotic fruit","Italy","Tropical"],"notes":"Fermented India Pale lager with bottom-fermented yeast, which gives great character and extreme ease of drinking. The aromatic notes of exotic fruit given by the abundant cold hopping prevail on the nose, in the mouth the slightly malty body leaves a dry finish in which the tropical and balsamic notes of the hops emerge easily.","vegan":false,"glutenFree":false}',
  '{"id":725,"name":"Amen","brewery":"War","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"5.5","colour":"#ebc325","style":"International Beer","styleImage":"American Ipa","dispenseMethod":"Cask","tags":["Citrus","Pink Grapefruit","Italy","Pineapple","Papaya","Orange"],"notes":"An Amercian IPA. The nose is immediately stimulated by the fragrances of hops, with a very evident citrus character, tinged with pink grapefruit and vanilla orange, which is accompanied by a subtle tropical vein with reminiscences of pineapple and papaya.","vegan":false,"glutenFree":false}',
  '{"id":726,"name":"Karma Points","brewery":"Zona Mosto","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"6","colour":"#dca001","style":"International Beer","styleImage":"Session Pale","dispenseMethod":"Bottle","tags":["Citrus","Pale Ale"],"notes":"Brewed with pale malt, wheat malt and oats. Aromas of citrus fruits and yellow-fleshed fruit (mango, pineapple), the taste is round and slightly bitter, with a distinctly fruity flavor that reflects the aroma. Hopped with Simcoe Citra and Eldorado.","vegan":false,"glutenFree":false}',
  '{"id":727,"name":"Strawberry Peach Sour","brewery":"Lord Chambray","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"3.9","colour":"#c2c2c2","style":"International Beer","styleImage":"Other","dispenseMethod":"Bottle","tags":["Peaches","Strawberry"],"notes":"Our first kettle sour ale is a balance between fruit and acidity, finishing off with a refreshing dryness. Light malt sweetness, crisp lemon-like sourness and a rich fruit flavour. A light body, a vibrant carbonation, and a snappy tartness for great drinkability.","vegan":false,"glutenFree":false}',
  '{"id":728,"name":"null","brewery":"null","barCode":"null","barName":"null","barLocation":"null","abv":"0","colour":"null","style":"null","styleImage":"null","dispenseMethod":"null","tags":[],"notes":"null","vegan":false,"glutenFree":false}',
  '{"id":729,"name":"Sylvia","brewery":"Lord Chambray","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"5.6","colour":"#dca001","style":"International Beer","styleImage":"Session Pale","dispenseMethod":"Cask","tags":["Malta","Lemon","Simcoe","Mosaic","Citra"],"notes":"A citrus pale ale brewed with our friends from Magic Rock Brewing. We add massive amounts of local lemon and orange zest and combine it all with an overload of Simcoe, Mosaic, and Citra hops to make this beer extremely citrusy, drinkable and refreshing.","vegan":false,"glutenFree":false}',
  '{"id":730,"name":"White Waves","brewery":"Lord Chambray","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"5.7","colour":"#dca001","style":"International Beer","styleImage":"Session Pale","dispenseMethod":"Cask","tags":["Wheat Beer","lta","itrus","ine","Coriander","Bitter Orange Peel"],"notes":"A spiced Belgian wheat beer abundantly hopped. Intense aroma of hops reminiscent of citrus and piny notes, thanks to the hops used during dry hopping. Citrusy taste and fruity flavour of intense hops, perfectly balanced by wheat, coriander and bitter orange peel.","vegan":false,"glutenFree":false}',
  '{"id":731,"name":"San Blas","brewery":"Lord Chambray","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"5.9","colour":"#b04500","style":"International Beer","styleImage":"British Ipa","dispenseMethod":"Cask","tags":["Malta","IPA","Citrus","Peach","Grapefruit","Orange"],"notes":"Full-bodied IPA dominated by the explosive character of a carefully selected hop blend that showcases the citrusy and peachy notes of American hop varieties, and the more subtle, spicy notes of British ones.","vegan":false,"glutenFree":false}',
  '{"id":732,"name":"67 IPA","brewery":"Lord Chambray","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"6.7","colour":"#4b100c","style":"International Beer","styleImage":"Red Ale","dispenseMethod":"Cask","tags":["IPA","Pine","lta","Citrus","Red","Caramel"],"notes":"Brewed in collaboration with our friends at 67 Kapitali, a specialist beer bar in Valletta. Bold beer that demands attention: old school piney and resiny aromas blend in with aromatic citrus and a sweet caramel backdrop. Clean and light bodied but crisp, hoppy, and aggressively bitter. A local favourite.","vegan":false,"glutenFree":false}',
  '{"id":733,"name":"Revival","brewery":"Lord Chambray","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"7","colour":"#c2c2c2","style":"International Beer","styleImage":"Other","dispenseMethod":"Cask","tags":["Pale Ale","Amarillo","Simcoe","saic","Cascade","tra","Pine","Citrus"],"notes":"This beer is a celebration to our 7th birthday! Pale ale, red-x and wheat malts are blended together with a spicy rye malt to give the perfect backbone for 5 hop varieties: amarillo, simcoe, mosaic, cascade and citra. A generous dry-hopping provides a refreshing blast of pine and citrus.","vegan":false,"glutenFree":false}',
  '{"id":734,"name":"Off-Road","brewery":"Lord Chambray","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"7","colour":"#070b0c","style":"null","styleImage":"Porter","dispenseMethod":"null","tags":["Malta","Stout","Coconut","Cocoa"],"notes":"A richly aromatic and flavorful Stout, brewed with plenty of natural coconut. Smooth mouthfeel and an intensive nose combine hints of coconut and cocoa.","vegan":false,"glutenFree":false}',
  '{"id":735,"name":"null","brewery":"null","barCode":"null","barName":"null","barLocation":"null","abv":"0","colour":"null","style":"null","styleImage":"null","dispenseMethod":"null","tags":[],"notes":"null","vegan":false,"glutenFree":false}',
  '{"id":736,"name":"null","brewery":"null","barCode":"null","barName":"null","barLocation":"null","abv":"0","colour":"null","style":"null","styleImage":"null","dispenseMethod":"null","tags":[],"notes":"null","vegan":false,"glutenFree":false}',
  '{"id":737,"name":"Fugu","brewery":"De Kromme Haring","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"6.5","colour":"#be7001","style":"International Beer","styleImage":"Strong Blonde","dispenseMethod":"Cask","tags":["Yuzu","Saison","Netherlands","Lemon"],"notes":"Yuzu aroma with some yeasty funk and some faint smoke. Sweet taste with a light sweet, not very dry finish. Combining bitter and lemony flavours with the spicy yeast character of the Belgian and French saison yeast strains.","vegan":false,"glutenFree":false}',
  '{"id":738,"name":"Rockfish","brewery":"De Kromme Haring","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"5.5","colour":"#4b100c","style":"null","styleImage":"Red Ale","dispenseMethod":"null","tags":["Amber","Netherlands"],"notes":"An American Amber / Red Ale with a soft body with biscuity, caramel flavours works with a subtle if present hop aroma and soft bitterness.","vegan":false,"glutenFree":false}',
  '{"id":739,"name":"null","brewery":"null","barCode":"null","barName":"null","barLocation":"null","abv":"0","colour":"null","style":"null","styleImage":"null","dispenseMethod":"null","tags":[],"notes":"null","vegan":false,"glutenFree":false}',
  '{"id":740,"name":"Barbarian Fishing V16","brewery":"De Kromme Haring","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"8","colour":"#be7001","style":"null","styleImage":"Strong Blonde","dispenseMethod":"null","tags":["Netherlands","NEIPA","IPA","New England IPA","Juicy"],"notes":"“Barbarian Fishing, the OG of our NEIPA stable, is a big and bold double IPA that ticks all the boxes on the hazy checklist; creamy, juicy, fruity, malty, brimming with hop aromas. We include a bit more bitterness than some other NEIPA to make it super more-ish. Each version is made with a different hop combination, check the print for the hops in this version!”","vegan":false,"glutenFree":false}',
  '{"id":741,"name":"Wahoo","brewery":"De Kromme Haring","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"6","colour":"#b04500","style":"International Beer","styleImage":"British Ipa","dispenseMethod":"Cask","tags":["IPA","Citra","Centennial","Azacca","Netherlands"],"notes":"IPA . The dry-hop (Azacca, Centennial, Citra) gives the beer its tropical fruity character complemented with a balanced bitterness and soft mouthfeel. Don\'t overthink it, just yell Wahoooooooo!","vegan":false,"glutenFree":false}',
  '{"id":742,"name":"Beluga","brewery":"De Kromme Haring","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"11","colour":"#070b0c","style":"null","styleImage":"Porter","dispenseMethod":"null","tags":["Imperial Stout","Complex","Chocolate","Coffee","Dried fruits"],"notes":"Beluga is a bold, roasted Russian Imperial Stout. Complex and luxurious, we get the requisite chocolate and coffee flavours, but enriched with subtle hints of leather and dried fruits.","vegan":false,"glutenFree":false}',
  '{"id":743,"name":"Mudskipper","brewery":"De Kromme Haring","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"5.5","colour":"#ebc325","style":"International Beer","styleImage":"American Ipa","dispenseMethod":"Cask","tags":["New England IPA","IPA","Netherlands","Fruity"],"notes":"Mudskipper is our New England IPA. The malt bill and London Ale yeast give this beer a very hazy appearance and a soft texture. Plenty of dry hop is added during fermentation, where bio-transformation creates very expressive and fruity flavours.","vegan":false,"glutenFree":false}',
  '{"id":744,"name":"Whale Shark V4","brewery":"De Kromme Haring","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"8.2","colour":"#ebc325","style":"International Beer","styleImage":"American Ipa","dispenseMethod":"Cask","tags":["Emmer","Netherlands","Hoppy","New England IPA","IPA"],"notes":"With Whale Shark we explore the creamy depths of the New England Double IPA. The quest is to make our silkiest and juiciest example yet. Aside from the usual oats, we added loads of specialty grains like emmer and chit malt to give the beer that über-luxurious mouthfeel. Heaps of hops finish this beer. Every version features a different hop combination","vegan":false,"glutenFree":false}',
  '{"id":745,"name":"Zander","brewery":"De Kromme Haring","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"9","colour":"#2d1410","style":"International Beer","styleImage":"Brown Ale","dispenseMethod":"Cask","tags":["Porter","Full bodied","Chocolate","es"],"notes":"Zander is a Baltic Porter: A complex, full bodied, dark lager with flavour notes of chocolate, dates, tobacco and black pepper. The lager yeast and cold lengthy maturation provides more subtle yeast flavours and a crisp aftertaste.","vegan":false,"glutenFree":false}',
  '{"id":746,"name":"California Sunset","brewery":"Kees","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"5.7","colour":"#ebc325","style":"International Beer","styleImage":"American Ipa","dispenseMethod":"Cask","tags":["Fruity","Orange","Sweet"],"notes":"Nice sessionable IPA - Mid level bitterness balanced by some sweet malt and fruity (orange and mango) hops.","vegan":false,"glutenFree":false}',
  '{"id":747,"name":"Anniversary No7","brewery":"Kees","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"11","colour":"#070b0c","style":"International Beer","styleImage":"Porter","dispenseMethod":"Cask","tags":["Porter","Chocolate","Liquorice","Coffee"],"notes":"Tastes are rich roast malt, chocolate, liquorice, coffee and hops. Nice roasty finish.","vegan":false,"glutenFree":false}',
  '{"id":748,"name":"Barrel Project 2023","brewery":"Kees","barCode":"B7","barName":"Beurs van Berlage","barLocation":"Grand Hall","abv":"0","colour":"#c2c2c2","style":"International Beer","styleImage":"Other","dispenseMethod":"Cask","tags":["Strong","Dark","Chocolate","Sweet"],"notes":"Strong aroma of wood and sweet vanilla. Flavour has dark chocolate and lots of bourbon. There\'s not too much of the Islay just an underlying hint.","vegan":false,"glutenFree":false}',
