  '{"id":1138,"name":"Kölsch","brewery":"Früh","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"4.8","colour":"#dca001","style":"International Beer","styleImage":"Session Pale","dispenseMethod":"Bottle","tags":["Clean","Clear","Refreshing"],"notes":"The people of Cologne just know how to enjoy life and always find a reason to toast with an early Kölsch. It is still brewed today according to Peter Josef Früh\'s original recipe - from the best ingredients and in accordance with the German Purity Law.","vegan":false,"glutenFree":false}',
  '{"id":1139,"name":"Kölsch","brewery":"Reissdorf","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"4.8","colour":"#ebc325","style":"International Beer","styleImage":"American Ipa","dispenseMethod":"Bottle","tags":["Full Bodied","Light","Drinkable"],"notes":"REISSDORF KÖLSCH is the Cologne beer specialty with a brewing tradition since 1894. As a Kölsch with a pleasant, full-bodied and unmistakably drinkable taste in PREMIUM quality, it is brewed for connoisseurs who prefer something special.","vegan":false,"glutenFree":false}',
  '{"id":1140,"name":"Alt","brewery":"Schumacher","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"4.6","colour":"#4b100c","style":"International Beer","styleImage":"Red Ale","dispenseMethod":"Bottle","tags":["Malty","Bitter","Top Fermented","Sparkling"],"notes":"Our sparkling, amber-colored SCHUMACHER ALT is a top-fermented specialty from Düsseldorf. It is characterized by a slender taste and a slightly malty hop note full of character. The fine bitterness from noble cone hops called Tettnanger from the Hallertau characterize the rounded aroma. With our SCHUMACHER ALT, the interaction of hops, malt &amp; Schumacher yeast has been perfected in the traditional brewing process.","vegan":false,"glutenFree":false}',
  '{"id":1141,"name":"Alt","brewery":"Uerige","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"4.7","colour":"#be7001","style":"International Beer","styleImage":"Strong Blonde","dispenseMethod":"Bottle","tags":["Caramel","Malts","Hoppy","Aromatic"],"notes":"Our top-fermented specialty has been brewed since 1862, and is made of barley malt, caramel malt, roasted malt, umbel hops, water – and our unique Uerige yeast.","vegan":false,"glutenFree":false}',
  '{"id":1142,"name":"Rauchbier Märzen","brewery":"Schlenkerla","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"5.1","colour":"#4b100c","style":"International Beer","styleImage":"Red Ale","dispenseMethod":"Bottle","tags":["Dark","Smokey"],"notes":"Bamberg\'s speciality, a dark, bottom fermented smokebeer, brewed with Original Schlenkerla Smokemalt from the Schlenkerla maltings and tapped according to old tradition directly from the gravity-fed oakwood cask in the historical brewery tavern.","vegan":false,"glutenFree":false}',
  '{"id":1143,"name":"Fastenbier","brewery":"Schlenkerla","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"5.9","colour":"#4b100c","style":"International Beer","styleImage":"Red Ale","dispenseMethod":"Bottle","tags":["Unfiltered","Smokey","Hoppy","Malty","Fullbodied"],"notes":"The Original Schlenkerla Lentbeer is an unfiltered smokebeer, brewed in accordance with the Bavarian Purity Law of 1516. Bottom-fermenting yeast gives the reddish brown lentbeer a natural cloudiness. Its smoky aroma is already noticeable in the smell, combined with a fine hoppy note. In the drink the fullbodied, highly drinkable lentbeer shows its strong malty flavour, rounded up with the smokey taste and a light bitterness. Due to the nourishing yeast, the Original Schlenkerla Lentbeer has the \\\"Brotzeit already included\\\" (German word for afternoon snack).","vegan":false,"glutenFree":false}',
  '{"id":1144,"name":"Lagerbier Hell","brewery":"Augustiner","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"5.2","colour":"#dca001","style":"International Beer","styleImage":"Session Pale","dispenseMethod":"Bottle","tags":["Mild","Fruity","Citrus","Sparkling","Refreshing"],"notes":"Augustiner Lagerbier Hell is a refreshing beer that’s mild, sparkling and relatively light. This classic Bavarian lager has fresh and fruity lemon notes giving it a pleasing citrusy flavour. Like most German beers, it’s best served cold and is brewed in accordance with the German purity laws, meaning it’s been made with just water, barley and hops. A long secondary fermentation makes for a lightly hoppy finish and an overall crisp, smooth flavour.","vegan":false,"glutenFree":false}',
  '{"id":1145,"name":"Lagerbier Dunkel","brewery":"Augustiner","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"5.6","colour":"#2d1410","style":"International Beer","styleImage":"Brown Ale","dispenseMethod":"Bottle","tags":["Dark","Malty","Herbal","Liquorice","Cola"],"notes":"This Munich dark lager brewed with pumpernickel malts and a blend of herbal hops. produces a classic character of dark roast malts, liquorice, and cola notes. Its dryness lifts the lager to a crisp finish.","vegan":false,"glutenFree":false}',
  '{"id":1146,"name":"Edelstoff","brewery":"Augustiner","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"5.6","colour":"#dca001","style":"International Beer","styleImage":"Session Pale","dispenseMethod":"Bottle","tags":["Crisp","Golden","Cut Grass","Herbal","Sweet Malts"],"notes":"Augustiner Edelstoff is a helles beer that is crisp, refreshing and bright gold in colour. This is a world class beer that’s made with only water, barley and hops, in accordance with German purity laws. Drinkers can expect understated notes of cut grass, herbs, sweet malts and a moderate level of bitterness. Combine this with its light bodiedness and delicate carbonation, and you have all the makings of a fantastic lager with a smooth mouthfeel.","vegan":false,"glutenFree":false}',
  '{"id":1147,"name":"Original","brewery":"Hofbräu","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"5.1","colour":"#ebc325","style":"International Beer","styleImage":"American Ipa","dispenseMethod":"Bottle","tags":["Golden","Malty","Full Bodied","Spicy","Balanced"],"notes":"Luminous golden yellow with foamy white crown – you can already taste the refreshment: Slightly malty, full-bodied, mature and with an elegant finish. A beer with character for connoisseurs with character.","vegan":false,"glutenFree":false}',
  '{"id":1148,"name":"Kellerbier","brewery":"Hofbräu","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"5.5","colour":"#be7001","style":"International Beer","styleImage":"Strong Blonde","dispenseMethod":"Bottle","tags":["Full Bodied","Cloudy","Amber"],"notes":"An unfiltered, bottom-fermented specialty for true connoisseurs of traditional beers. Full-bodied and naturally cloudy, this beer retains the original character of the ancient brewing tradition. The best barley malts and selected hop varieties give this specialty its unique aroma and characteristic appearance. The HB Kellerbier offers an extraordinary taste experience, with a slightly amber color and a compact foam. A beer for special moments.","vegan":false,"glutenFree":false}',
  '{"id":1149,"name":"Weissbier","brewery":"Hofbräu","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"5.1","colour":"#dca001","style":"International Beer","styleImage":"Session Pale","dispenseMethod":"Bottle","tags":["Fruity","Tangy","Sweet","Aromatic"],"notes":"Harmoniously fruity bouquet, fine yeast, tangy, aromatic with a mildly sweet finish","vegan":false,"glutenFree":false}',
  '{"id":1150,"name":"Weizen - Hell","brewery":"Schneider","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"5.4","colour":"#be7001","style":"International Beer","styleImage":"Strong Blonde","dispenseMethod":"Bottle","tags":["Bright","Wheat","Full Bodied","Mild","Fresh"],"notes":"Enjoying the moment in high spirits: \\\"Meine helle Weisse\\\" - a bright wheat beer with the original Schneider Weisse aroma, full-bodied and intensive. Its mild freshness is reviving and lifts the senses. The perfect companion for daydreaming on a summer\'s afternoon","vegan":false,"glutenFree":false}',
  '{"id":1151,"name":"Aventinus","brewery":"Schneider","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"8.2","colour":"#4b100c","style":"International Beer","styleImage":"Red Ale","dispenseMethod":"Bottle","tags":["Dark","Warming","Sweet Malt","Strong"],"notes":"\\\"Mein Aventinus\\\" - the wholehearted, dark ruby coloured wheat beer, intensive and fiery, warming, well-balanced and tender. Bavaria\'s oldest wheat \\\"Doppelbock\\\" - brewed since 1907! Its sturdy body in combination with its sweet malty aroma is an invitation to profound indulgence - an ingenious blend with a strong body.","vegan":false,"glutenFree":false}',
  '{"id":1152,"name":"Dunkel","brewery":"Andechs","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"4.9","colour":"#4b100c","style":"International Beer","styleImage":"Red Ale","dispenseMethod":"Bottle","tags":["Chocolate","Caramel","Cocoa","Dark Malts","Malty"],"notes":"Soft dark malt aromas accompanied by notes of caramel and cocoa with a hint of smoke flavour reach the beer connoisseur’s nose starting with the first sip. Andechser Dunkel is pleasantly tangy with a full, round body and malt aroma. The semi-sweet chocolate note fits very well with the soft roast bitterness. It has a mild and harmonious finish.","vegan":false,"glutenFree":false}',
  '{"id":1153,"name":"Hell","brewery":"Andechs","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"4.8","colour":"#dca001","style":"International Beer","styleImage":"Session Pale","dispenseMethod":"Bottle","tags":["Fresh","Soft malts","Velvety","Full Bodied"],"notes":"The fine-pored foam is long-lasting. It is pure and cellar fresh on the nose with soft malt aromas permeated with floral hop tones. Lively and pleasant to drink, it has a light and soft body. The mild sweetness combines very well with a velvety soft hop bitterness. It has a round and harmonious finish – a genuine, classic, full-bodied Bavarian beer.","vegan":false,"glutenFree":false}',
  '{"id":1154,"name":"Weißbier Hell","brewery":"Andechs","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"5.5","colour":"#be7001","style":"International Beer","styleImage":"Strong Blonde","dispenseMethod":"Bottle","tags":["Fruity","Cloves","Wheat Beer","Honey","Full Bodied"],"notes":"Striking fruit aromas such as banana and honey melon emerge first, followed by fine cloves. Andechser Weißbier Hell is very tangy and refreshing to drink, featuring a full and soft body. In the finish, the balanced interplay of a slight honey sweetness with an elegant acidity and hop bitterness in the background quickly leads to a harmonious aftertaste. A wheat beer with the taste of the unique Andechs way of life: Lively and tangy with a mild yeast aroma, it leaves you wanting more.","vegan":false,"glutenFree":false}',
  '{"id":1155,"name":"Spezial Hell","brewery":"Andechs","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"5.9","colour":"#be7001","style":"International Beer","styleImage":"Strong Blonde","dispenseMethod":"Bottle","tags":["Sweet","Malty","Hoppy","Balanced","Tangy"],"notes":"Its bright, clear appearance and stable, fine-pored foam corresponds to its fresh and pure fragrance. Aromatic malt flavours come to the foreground. Spezial Hell is pleasantly tangy with a full, round malt flavour. The soft taste is marked by balanced sweetness and hop bitterness nuances. Gentle, soft malt aromas follow in the finish","vegan":false,"glutenFree":false}',
  '{"id":1156,"name":"Bergbock Hell","brewery":"Andechs","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"6.9","colour":"#dca001","style":"International Beer","styleImage":"Session Pale","dispenseMethod":"Bottle","tags":["Golden","Strong","Flowery","Full Bodied","Honey"],"notes":"With a luminous golden colour and bright, clear appearance, its fine-pored foam invites you to take that first sip. Strong malt and flowery hop aromas permeated with light fruit aromas. Although it is potent, Bergbock is pleasantly full-bodied with a strong but not obtrusive flavour. A very fine, discreet hop bitterness mingles with a slight honey sweetness, ending in a soft, harmonious finish. A balanced light bock beer full of character that ensures your first sip will not be the last.","vegan":false,"glutenFree":false}',
  '{"id":1157,"name":"Hell","brewery":"Tegernsee","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"4.8","colour":"#dca001","style":"International Beer","styleImage":"Session Pale","dispenseMethod":"Bottle","tags":["Clear","Golden","Floral","Honey","Bready"],"notes":"Tegernseer Hell is a classic Munich Hell Beer, otherwise known as a Helles Lager. Pouring a crystal clear, light golden colour, this beer offers up delicate floral, honey aromas. The first sip reveals a full-bodied malt flavour with bready characteristics and low bitterness - an easy-drinking, yet flavourful brew.","vegan":false,"glutenFree":false}',
  '{"id":1158,"name":"Spezial Hell","brewery":"Tegernsee","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"5.6","colour":"#dca001","style":"International Beer","styleImage":"Session Pale","dispenseMethod":"Bottle","tags":["Golden","Crisp","Biscuit Malt","Orange","Floral"],"notes":"Tegernseer Spezial Hell pours a crisp golden colour, with the aroma of bread, biscuit malt and a faint floral note from the hops. The flavour is malty, with a hint of orange and floral hops, with a slightly bitter finish. Buy Tegernseer Spezial Hell for a crisp, refreshing Dortmunder designed to help you unwind at the end of a long day.","vegan":false,"glutenFree":false}',
  '{"id":1159,"name":"Pils","brewery":"Jever","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"4.9","colour":"#ebc325","style":"International Beer","styleImage":"American Ipa","dispenseMethod":"Bottle","tags":["Dry","Bitter","Hoppy","Bitter","Herbal"],"notes":"Founded in the 1840\'s, Jever typifies the very dry style of pilsener from Friesland in the north-west corner of Germany and this remarkable beer is lagered for an impressive 90 days. Although only a small brewery, the \'Friesische Brauhaus zu Jever\' has become a top brewery in Germany producing this extra dry pilsener. It\'s also one of the most bitter, hoppy lagers in the Germany, as indicated by \'herb\' on the label. Because the Friesland water is very soft, Jever can add more hops when brewing to create the rather different taste.","vegan":false,"glutenFree":false}',
  '{"id":1160,"name":"Keller Bier","brewery":"St. Georgen Bräu","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"4.9","colour":"#dca001","style":"International Beer","styleImage":"Session Pale","dispenseMethod":"Bottle","tags":["Cloudy","Unfiltered","Full Bodied"],"notes":"A beer with heart and hand! We brew our original St. Georgen Bräu cellar beer traditionally using the finest aroma hops, based on an age-old recipe . Naturally cloudy, unfiltered, untapped and completely untreated, it matures in our deep Buttenheim cellars.","vegan":false,"glutenFree":false}',
  '{"id":1161,"name":"Weißbier Hell","brewery":"St. Georgen Bräu","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"4.6","colour":"#be7001","style":"International Beer","styleImage":"Strong Blonde","dispenseMethod":"Bottle","tags":["Caramel","Banana","Cloudy","Hoppy"],"notes":"Made with spring water from the St. Georgen Bräu spring, this is a light, caramel-colored wheat and barley malt beer with the finest aroma hops \\\"Hallertauer Tradition\\\" and \\\"Splinter Select\\\"","vegan":false,"glutenFree":false}',
  '{"id":1162,"name":"Hefe Hell","brewery":"Hopf","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"5.5","colour":"#dca001","style":"International Beer","styleImage":"Session Pale","dispenseMethod":"Keg","tags":["Light","Classic","Golden","wheat","fruity"],"notes":"The classic Wheat beer for which connoisseurs appreciate its unmistakable characteristics. Typical in its wheat beer aroma, this classic wheat beer has a slightly fruity taste, is golden yellow in colour and a light yeast haze, topped by a fine head. Its unique character is thanks to Hopf’s own pure yeast culture.","vegan":false,"glutenFree":false}',
  '{"id":1163,"name":"Hefe Dunkel","brewery":"Hopf","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"5.3","colour":"#4b100c","style":"International Beer","styleImage":"Red Ale","dispenseMethod":"Keg","tags":["Dark","Malts","Tangy","Lemon","Spice"],"notes":"Using only dark malts combined with the freshness of Hopf\'s own yeast, promises a pleasant taste. Aromas of fruity malts and caramel that combines tangy wheat beer flavours with a hint of lemon and spice. An authentic dark wheat beer.","vegan":false,"glutenFree":false}',
