  '{"id":1166,"name":"Guidobald Export Dunkel","brewery":"Wieninger","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"5","colour":"#2d1410","style":"International Beer","styleImage":"Brown Ale","dispenseMethod":"Keg","tags":["Tart","Roasted","Dark","Malty"],"notes":"In honor of Archbishop Guidobald Graf v. Thun (1615-1668), founder of the former Hofpruyhaus Teisendorf. A down-to-earth beer with a strong dark color and intense roasted aromas from the naturally dark malt.","vegan":false,"glutenFree":false}',
  '{"id":1167,"name":"Weissbier Hell","brewery":"Wieninger","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"5.3","colour":"#dca001","style":"International Beer","styleImage":"Session Pale","dispenseMethod":"Keg","tags":["Yeasty","Tangy","Fruity","Wheat Beer"],"notes":"A classic wheat beer. Yeasty and cloudy with a golden yellow color and strong foam. It impresses with its fruity aroma, the sparkling initial taste and its mild, soft taste.","vegan":false,"glutenFree":false}',
  '{"id":1168,"name":"Bayerisch Hell","brewery":"Zötler","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"4.9","colour":"#ebc325","style":"International Beer","styleImage":"American Ipa","dispenseMethod":"Keg","tags":["Sweet malts","Full bodied","Light Beer"],"notes":"Our light beer shines in typical light yellow as soon as it is poured and presents a white, fine-pored foam. Fine, sweet malt notes fill the air. Full-bodied and yet slim in the drink due to the high degree of fermentation - with a balanced hop and malt aroma.","vegan":false,"glutenFree":false}',
  '{"id":1169,"name":"1447 Kellerbier","brewery":"Zötler","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"4.9","colour":"#be7001","style":"International Beer","styleImage":"Strong Blonde","dispenseMethod":"Keg","tags":["Amber","Fruity"],"notes":"Our 1447 Kellerbier has a shimmering amber colour, with a fine cloudiness and white foam. The top-fermenting ale yeast used specifically for this beer and the special hopping give it a fresh, fruity smell and taste. The 1447 Kellerbier is rounded off by its liveliness. A beer dedicated to our 570+ years of existence.","vegan":false,"glutenFree":false}',
  '{"id":1170,"name":"Gold","brewery":"Zötler","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"5.3","colour":"#ebc325","style":"International Beer","styleImage":"American Ipa","dispenseMethod":"Keg","tags":["Golden","Spicy Malts","Bitterness"],"notes":"The Zötler Gold is our flagship! Golden yellow and shiny, crowned by a very fine-pored foam, our Zötler Gold shines in the glass and the fine, spicy scent of malt fills the air. The fine malt aromas can also be found in the taste, which are replaced by a subtle bitterness. A beer that creates joie de vivre and enjoyment.","vegan":false,"glutenFree":false}',
  '{"id":1171,"name":"Pils","brewery":"Zötler","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"4.9","colour":"#ebc325","style":"International Beer","styleImage":"American Ipa","dispenseMethod":"Keg","tags":["Light"],"notes":"Our Pils convinces with its shiny, light yellow color and its fine-pored foam. The slim and balanced body is rounded off by a subtle hop note typical of pilsner. A fine Allgäu Pils.","vegan":false,"glutenFree":false}',
  '{"id":1172,"name":"Hefeweizen Hell","brewery":"Zötler","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"5.2","colour":"#be7001","style":"International Beer","styleImage":"Strong Blonde","dispenseMethod":"Keg","tags":["Wheat Beer","ght","Fruity","Spicy"],"notes":"Our light wheat beer presents itself in a fresh, straw-yellow colour, with fine yeast haze and dense, fine-pored foam. Before you can enjoy the sparkling drink, the pure, fruity-spicy smell hits your nose. A pure pleasure, also thanks to our pure cultured yeast.","vegan":false,"glutenFree":false}',
  '{"id":1173,"name":"Korbinian Dunkel","brewery":"Zötler","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"5.2","colour":"#2d1410","style":"International Beer","styleImage":"Brown Ale","dispenseMethod":"Keg","tags":["Nutty","Roasty","Malty","Chocolate","Creamy"],"notes":"We have been brewing our Korbinian Dunkel for over 500 years. Chestnut brown with a creamy, brown froth, our dark beer shines in the glass and the fine roasted malt aroma and a hint of chocolate fill the air. These aromas are also found in the mouth and present a pleasantly full-bodied drinking experience.","vegan":false,"glutenFree":false}',
  '{"id":1174,"name":"Feines Urhell","brewery":"Riegele","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"4.7","colour":"#dca001","style":"International Beer","styleImage":"Session Pale","dispenseMethod":"Keg","tags":["Refreshing","Malty","Hoppy","Balanced"],"notes":"The classic one – The Feines Urhell is a bright joy! For generations maintained with love, classically brewed, unpasteurized, and matured in peace. Refreshing with a fine, balanced, malty and hoppy taste.","vegan":false,"glutenFree":false}',
  '{"id":1175,"name":"Commerzienrat Riegele Privat","brewery":"Riegele","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"5.2","colour":"#dca001","style":"International Beer","styleImage":"Session Pale","dispenseMethod":"Keg","tags":["Smooth"],"notes":"Winner of the “Beer of the Decade,” “Beer of the Year,” World Beer Cup,\\\" 9-time DLG Gold and the 6-Time European Gold Star, Privat sets the benchmark for craft festival lagers. Crisp, elegant, and complex in character, Privat is perfectly balanced with a clean and remarkably smooth finish thanks to the Riegele husk separation process.","vegan":false,"glutenFree":false}',
  '{"id":1176,"name":"Augsburger Herren Pils","brewery":"Riegele","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"4.7","colour":"#ebc325","style":"International Beer","styleImage":"American Ipa","dispenseMethod":"Keg","tags":["Crisp","Hoppy","Bitterness","Balanced"],"notes":"Augsburg has been steeped in great brewing tradition since 1156 when Emperor Friedrich Barbarossa issued it the first known purity law in Germany. True to its imperial-city namesake, Augsburger Herrenpils is an exemplary German Pils. Crisp, clean, with an ideal hoppy bitterness that adds perfect balance and structure to this internationally celebrated Pilsener.","vegan":false,"glutenFree":false}',
  '{"id":1177,"name":"Hefe Weisse Hell","brewery":"Riegele","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"5","colour":"#be7001","style":"International Beer","styleImage":"Strong Blonde","dispenseMethod":"Keg","tags":["Wheat Beer","Fruity","Refreshing","Full Bodied"],"notes":"The Bavarian Classic. Wheat beer at its finest. Refreshing, fruity, full-bodied, and bursting with flavor. Top fermented, natural and unfiltered, this hand-crafted Weissbier is a fine choice for a sunny beergarden or a Sunday morning Bavarian Weisswurst breakfast with family and friends. Gemutlichkeit!","vegan":false,"glutenFree":false}',
  '{"id":1178,"name":"IPA","brewery":"Riegele","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"5","colour":"#be7001","style":"International Beer","styleImage":"Strong Blonde","dispenseMethod":"Keg","tags":[],"notes":"","vegan":false,"glutenFree":false}',
  '{"id":1179,"name":"Bayerisch Ale 2","brewery":"Riegele","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"5","colour":"#ebc325","style":"International Beer","styleImage":"American Ipa","dispenseMethod":"Keg","tags":["Delicate","Dry","Passion fruit","Peach","Apricot"],"notes":"Bayerisch Ale 2 arose from the hoppy friendship between US Craft Beer Pioneer Sierra Nevada and Germanys Craft Brewery of the Year 2017/2018, Riegele BierManufaktur.","vegan":false,"glutenFree":false}',
  '{"id":1180,"name":"Aechtes Dunkel","brewery":"Riegele","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"4.9","colour":"#070b0c","style":"International Beer","styleImage":"Porter","dispenseMethod":"Keg","tags":["Dark","Double toasted","Balanced","Aromatic"],"notes":"One of the most sought after of the dark German styles, Aechtes “Genuine” Dunkel owes its pedigree to years of craft brewing with only the finest and rare double-toasted Bavarian malts. Only this elaborate procedure guarantees the particularly balanced roasted aromatic taste - unpasteurized, dark, and real.","vegan":false,"glutenFree":false}',
  '{"id":1181,"name":"Kellerbier","brewery":"Riegele","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"5","colour":"#4b100c","style":"International Beer","styleImage":"Red Ale","dispenseMethod":"Keg","tags":["Unfiltered","Unpasteurised","Jura Malts"],"notes":"This unfiltered, unpasteurized fermenting cellar ale is shaped by temperature and time. It all begins with Kellerbier’s special ale yeast which harmonizes with Bavarian Wheat and three select Jura Malts to produce an artisan classic that has earned Kellerbier international awards and gold medals.","vegan":false,"glutenFree":false}',
  '{"id":1182,"name":"Speziator Hell (Doppelbock)","brewery":"Riegele","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"8.5","colour":"#dca001","style":"International Beer","styleImage":"Session Pale","dispenseMethod":"Keg","tags":["Rich","Golden","Velvety","Strong"],"notes":"Steeped in generations of rich Bavarian tradition, Speziator embodies the passion and beauty from which it derives its name. First brewed by Bavarian monks over 300 years ago, Doppelbock Hell is distinguished by its rich gold color, elevated alcohol content, and velvety mouthfeel. As a gold medal and European Gold Star winner, Speziator hell sets the standard for imperial lagers.","vegan":false,"glutenFree":false}',
  '{"id":1183,"name":"Speziator Dunkel (Doppelbock)","brewery":"Riegele","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"7.5","colour":"#2d1410","style":"International Beer","styleImage":"Brown Ale","dispenseMethod":"Keg","tags":["Dark","Fiery","Strong","Velvety"],"notes":"The dark counterpart to Speziator Hell. Also brewed by Bavarian monks over 300 years ago, Doppelbock Dark is distinguished by its dark but fiery color, elevated alcohol content, and velvety mouthfeel. As a European Gold Star winner, Speziator Dunkel sets the standard for imperial dark lagers.","vegan":false,"glutenFree":false}',
  '{"id":1184,"name":"Lauterbacher Natur Hell","brewery":"Riegele","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"4.8","colour":"#dca001","style":"International Beer","styleImage":"Session Pale","dispenseMethod":"Keg","tags":["Unfiltered","Full bodied","Hoppy","Malty"],"notes":"A natural light, as it should be. The Lauterbacher Natur Hell remains unfiltered and therefore has a particularly full-bodied character. Refreshingly hoppy and pleasantly malty","vegan":false,"glutenFree":false}',
  '{"id":1185,"name":"Lauterbacher Natur Weizen","brewery":"Riegele","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"5.3","colour":"#be7001","style":"International Beer","styleImage":"Strong Blonde","dispenseMethod":"Keg","tags":["Cloudy","Tasty","Strong","Golden"],"notes":"In 1889 the first wheat beer was brewed in Lauterbach, Bavaria. And to this day, Lauterbacher Natur Weizen is something very special. Naturally cloudy, tasty and strong golden, just like the Lauterbach country man used to like to drink.","vegan":false,"glutenFree":false}',
  '{"id":1186,"name":"Lauterbacher Brotzeit Bier","brewery":"Riegele","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"5.1","colour":"#ebc325","style":"International Beer","styleImage":"American Ipa","dispenseMethod":"Keg","tags":["Natural","Tasty","Clear","Golden"],"notes":"A Lauterbacher snack beer is part of a Bavarian break! Natural, tasty, down-to-earth, just like the Lauterbach country man used to like to drink. Clear &amp; golden, with refreshing Hallertau hops","vegan":false,"glutenFree":false}',
  '{"id":1187,"name":"Pils","brewery":"Wildbrau","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"4.8","colour":"#dca001","style":"International Beer","styleImage":"Session Pale","dispenseMethod":"Keg","tags":["Sweet","Soft","Aroma Hops"],"notes":"In memory of Korbinian Wild. He refined the recipe of the fine, Czech, bitter pils and used only aroma hops instead of bitter hops. These sweeten this traditional variety and soften the bitter taste.","vegan":false,"glutenFree":false}',
  '{"id":1188,"name":"Grandauer Export Hell","brewery":"Wildbrau","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"5.1","colour":"#dca001","style":"International Beer","styleImage":"Session Pale","dispenseMethod":"Keg","tags":["Floral","Spicy","Malty","Toasted"],"notes":"Malt-forward flavor and the sweetness of a German-style Helles, but the bitter base of a German-style Pilsener. This beer is all about balance, with medium hop character and firm but low malt sweetness. Look for toasted malt flavors and spicy floral hop aromas.","vegan":false,"glutenFree":false}',
  '{"id":1189,"name":"Hell","brewery":"Wildbrau","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"5","colour":"#dca001","style":"International Beer","styleImage":"Session Pale","dispenseMethod":"Keg","tags":["Spice","Mild","Sweet","Malt","Clear"],"notes":"The epitome of Bavarian beer and also the trademark of the Wildbräu brewery. Not only hops and malt flow into our Helles, but above all the innovation of our master brewer, who gives this type of beer its extraordinary taste of spice and mildness. The Helle is brewed bottom-fermented, fermented at 9°C and then stored for six weeks until the final filtration. Already during the bottling, the fine-sweet malt notes rise to the nose","vegan":false,"glutenFree":false}',
  '{"id":1190,"name":"Zwickl","brewery":"Wildbrau","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"0","colour":"#dca001","style":"null","styleImage":"Session Pale","dispenseMethod":"null","tags":["Unfiltered","Soft","Creamy","Spicy","Aromatic"],"notes":"This Zwickl is the unfiltered brew of our light beer with its typical yeast and protein turbidity. In the smell you can clearly feel the slightly fruity notes that emanate from the remaining yeast. Opal cloudy, mild and aromatic with malt, it is our master brewer\'s favorite beer. Wildbräu Zwickl still contains all the clouding ingredients that give the beer a very soft, creamy, spicy taste. After four weeks of maturing, it is bottled unfiltered.","vegan":false,"glutenFree":false}',
  '{"id":1191,"name":"Meistersud","brewery":"Wildbrau","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"5.8","colour":"#dca001","style":"International Beer","styleImage":"Session Pale","dispenseMethod":"Keg","tags":["malty","Spicy","Bottom Fermented"],"notes":"Our MEISTERSUD presents itself as a bottom-fermented beer with a malty-spicy taste.","vegan":false,"glutenFree":false}',
  '{"id":1192,"name":"Weiss Gold","brewery":"Meckatzer","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"5.2","colour":"#ebc325","style":"International Beer","styleImage":"American Ipa","dispenseMethod":"Keg","tags":["Herbal","Fruity","Rich","Balanced","Hoppy"],"notes":"In the glass it shows itself in a light gold tone with sunny reflections, crowned by a white, fine foam with good adhesion. It smells of hay, biscuit and something herbal and fruity. The initial taste is soft with very finely integrated carbon dioxide, which rises creamy in the mouth. Malt body and hop bitterness are perfectly balanced in the overall character. The finish is subtle and hoppy.","vegan":false,"glutenFree":false}',
  '{"id":1193,"name":"Hell","brewery":"Meckatzer","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"4.9","colour":"#ebc325","style":"International Beer","styleImage":"American Ipa","dispenseMethod":"Keg","tags":["Harmonious","Spicy","Fresh"],"notes":"The combination of the finest aroma hops from Tettnang on Lake Constance with an elaborately coordinated composition of light brewing malts from Upper Swabia ensures the exceptional and consistently high quality of this type of beer, which is so typical of Bavaria. The tasty and finely spicy character of this beer is already evident in its brilliant, light color and the stable head of foam. Uniquely harmonious and round, fresh, lean and with a subtle hint of hops, typical of the variety, Meckatzer Hell tastes good at the first sip - and makes you want more.","vegan":false,"glutenFree":false}',
  '{"id":1194,"name":"Pils","brewery":"Meckatzer","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"4.8","colour":"#ebc325","style":"International Beer","styleImage":"American Ipa","dispenseMethod":"Keg","tags":["Pine","Citrus","Grainy-Fruit Malt","Light","Dry"],"notes":"The brilliant Meckatzer Pils is characterized by its balanced taste: it is light and straightforward, has a subtle, grainy-fruity malt note and a fine tartness. It owes its soft hop aroma to the finest Tettnang aroma hops. It is clear, with a firm, white foam layer that stretches straight up and has a pleasant pine and citrus note. The initial taste is dry, the body slim.","vegan":false,"glutenFree":false}',
  '{"id":1195,"name":"Hefeweizen Hell","brewery":"Meckatzer","barCode":"B6","barName":"Schlenkerla","barLocation":"Grand Hall","abv":"5.2","colour":"#be7001","style":"International Beer","styleImage":"Strong Blonde","dispenseMethod":"Keg","tags":["Velvety","Banana","Pear","Caramel","Nutmeg"],"notes":"Six noble types of malt, the finest aromatic hops and the highest level of master brewing skills give the Meckatzer Weizen its varietal, sparkling fruit aroma and fine hop flower. Amber yellow with a firm, fine-pored foam, the light wheat smells fresh of citrus fruits, apple, nutmeg and vanilla. The first taste flatters the palate silky. A velvety mouthfeel conveys notes of banana and pear, accompanied by light caramel and a fruity bitterness. The finish is soft, elegant and flavored with a hint of nutmeg.","vegan":false,"glutenFree":false}',
