  '{"id":1209,"name":"Abbot Ale","brewery":"Greene King","barCode":"B5a","barName":"Greene King","barLocation":"B5a","abv":"5","colour":"#b04500","style":"Session Bitter","styleImage":"British Ipa","dispenseMethod":"Cask","tags":["Admiral","Fuggle","First Gold","Pilmgrim","Bitter"],"notes":"Warming, malty and fruity. Pale and amber malts contribute to a mouth filling and satisfying \'Horlicks\' and biscuity maltiness. Challenger and First Gold give a base note of herbal hop and Fuggles as a late hop contributes the main fragrant fruity and floral and spicy notes. Fermented slowly to give just enough fruity esters Abbot Ale provides a complex, satisfying and warming experience.","vegan":false,"glutenFree":false}',
  '{"id":1210,"name":"Chula Vista","brewery":"Thornbridge","barCode":"B18e","barName":"Thornbridge","barLocation":"National Hall","abv":"4.2","colour":"#ebc325","style":"Speciality - Flavoured Light","styleImage":"American Ipa","dispenseMethod":"KeyKeg","tags":["Citrus","Fruits"],"notes":"Lemon and Sea Salt Sour named after the town in California famous for growing citrus fruits thanks to the terroir and climate.","vegan":false,"glutenFree":false}',
  '{"id":1211,"name":"Green Mountain","brewery":"Thornbridge","barCode":"B18e","barName":"Thornbridge","barLocation":"National Hall","abv":"4.3","colour":"#dca001","style":"Session Blond Ale","styleImage":"Session Pale","dispenseMethod":"KeyKeg","tags":["Dry","Session"],"notes":"A beautiful hazy Vermont Session IPA. We generously dry hop with Galaxy, Mosaic, Citra and Amarillo hops, creating a hugely aromatic and juicy fruit bomb.","vegan":true,"glutenFree":false}',
  '{"id":1212,"name":"Lukas","brewery":"Thornbridge","barCode":"B18e","barName":"Thornbridge","barLocation":"National Hall","abv":"4.2","colour":"#ebc325","style":"Speciality - Differently Produced Light","styleImage":"American Ipa","dispenseMethod":"KeyKeg","tags":["Light","Lager"],"notes":"Our Helles lager, Lukas, is brewed with Bavarian ingredients and undergoes a long lagering period to make sure it’s in perfect condition when packaged. In keg it is the go-to lager option for our own pubs and many others, in can and bottle it fills the fridges of numerous homes around the country. It’s light, crisp and has just a little malt sweetness which is characteristic of this traditional style.","vegan":false,"glutenFree":false}',
